y=JSON.parse('[{"_id":"610f93ad8e338e5b6446da3e","authors":["Xiao Chen","Wanli Chen","Kui Liu","Chunyang Chen","Li Li"],"title":"A comparative study of smartphone and smartwatch apps","link":"","description":"Despite that our community has spent numerous efforts on analyzing mobile apps, there is no study proposed for characterizing the relationship between smartphone and smartwatch apps. To fill this gap, we present to the community a comparative study of smartphone and smartwatch apps, aiming at understanding the status quo of cross-phone/watch apps. Specifically, in this work, we first collect a set of cross-phone/watch app pairs and then experimentally look into them to explore their similarities or dissimilarities from different perspectives. Experimental results show that (1) Approximately, up to 40% of resource files, 30% of code methods are reused between smartphone/watch app pairs,(2) Smartphone apps may require more than twice as many as permissions and adopt more than five times as many as user interactions than their watch counterparts, and (3) Smartwatch apps can be released as either\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 36th Annual ACM Symposium on Applied Computing","pages":"1484-1493","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f95618e338e5b6446da86","authors":["Lydia Cvejic","Nadine Guiney","Tiffany Nicholson","Kenneth K Lau","Paul Finlay","Kais Hamza","Christian Osadnik","Paul Leong","Martin MacDonald","Paul T King","Philip G Bardin"],"title":"Aspiration and severe exacerbations in COPD: a prospective study","link":"https://openres.ersjournals.com/content/erjor/7/1/00735-2020.full.pdf","description":"Rationale\\nSwallow may be compromised in COPD leading to aspiration and adverse respiratory consequences. However, prevalence and consequences of detectable aspiration in stable COPD are not known.\\nObjectives\\nWe tested the hypothesis that a significant number of patients with stable COPD will have detectable aspiration during swallow (prandial aspiration) and that they would experience more frequent severe acute exacerbations of COPD (AECOPD) over the subsequent 12\u2005months.\\nMethods\\nPatients (n=151) with verified and stable COPD of all severities were recruited at a tertiary care hospital. Videofluoroscopy was conducted to evaluate aspiration using Rosenbek9s scale for penetration\u2013aspiration during 100-mL cup drinking. AECOPD was documented as moderate (antibiotics and/or corticosteroid treatment) or severe (emergency department admission or hospitalisation) over the ensuing 12\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"ERJ open research","pages":"","publisher":"European Respiratory Society","volume":"7","issue":"1"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f93ad8e338e5b6446da3d","authors":["Sidong Feng","Suyu Ma","Jinzhong Yu","Chunyang Chen","TingTing Zhou","Yankun Zhen"],"title":"Auto-icon: An automated code generation tool for icon designs assisting in ui development","link":"","description":"Approximately 50% of development resources are devoted to UI development tasks [8]. Occupied a large proportion of development resources, developing icons can be a time-consuming task, because developers need to consider not only effective implementation methods but also easy-to-understand descriptions. In this study, we define 100 icon classes through an iterative open coding for the existing icon design sharing website. Based on a deep learning model and computer vision methods, we propose an approach to automatically convert icon images to fonts with descriptive labels, thereby reducing the laborious manual effort for developers and facilitating UI development. We quantitatively evaluate the quality of our method in the real world UI development environment and demonstrate that our method offers developers accurate, efficient, readable, and usable code for icon images, in terms of saving 65.2\xa0\u2026","yearPublished":"2021","citedBy":1,"category":{"type":"BOOK","categoryTitle":"26th International Conference on Intelligent User Interfaces","pages":"59-69","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f93ad8e338e5b6446da40","authors":["Kaibo Cao","Chunyang Chen","Sebastian Baltes","Christoph Treude","Xiang Chen"],"title":"Automated Query Reformulation for Efficient Search based on Query Logs From Stack Overflow","link":"https://arxiv.org/pdf/2102.00826","description":"As a popular Q&A site for programming, Stack Overflow is a treasure for developers. However, the amount of questions and answers on Stack Overflow make it difficult for developers to efficiently locate the information they are looking for. There are two gaps leading to poor search results: the gap between the user\u2019s intention and the textual query, and the semantic gap between the query and the post content. Therefore, developers have to constantly reformulate their queries by correcting misspelled words, adding limitations to certain programming languages or platforms, etc. As query reformulation is tedious for developers, especially for novices, we propose an automated software-specific query reformulation approach based on deep learning. With query logs provided by Stack Overflow, we construct a large-scale query reformulation corpus, including the original queries and corresponding reformulated ones\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"CONFERENCE","categoryTitle":"43rd International Conference on Software Engineering (ICSE)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f95618e338e5b6446da80","authors":["J Koh","L Ruane","M Baxter","D Phyland","P Leong","K Lau","K Hamza","P Bardin"],"title":"CONCORDANCE OF LARYNGOSCOPY AND DYNAMIC COMPUTERIZED TOMOGRAPHY LARYNX TO DIAGNOSE VOCAL CORD DYSFUNCTION","link":"","description":"","yearPublished":"2021","citedBy":null,"category":{"type":"CONFERENCE","categoryTitle":"RESPIROLOGY","pages":"102-102","publisher":"WILEY","volume":"26","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f93ad8e338e5b6446da3b","authors":["Junjie Wang","Ye Yang","Song Wang","Chunyang Chen","Dandan Wang","Qing Wang"],"title":"Context-aware Personalized Crowdtesting Task Recommendation","link":"","description":"Crowdsourced software testing (short for crowdtesting) is a special type of crowdsourcing. It requires that crowdworkers master appropriate skill-sets and commit significant effort for completing a task. Abundant uncertainty may arise during a crowdtesting process due to imperfect information between the task requester and crowdworkers. For example, a worker frequently chooses tasks in an ad hoc manner in crowdtesting context, and an inappropriate task selection may lead to the worker\'s failing to detect any bugs, and significant testing effort unpaid and wasted. Recent studies have explored methods for supporting task requesters to make informed decisions on task pricing, worker recommendation, and so on. Unfortunately, very few study offers decision making support from the crowdworkers\' perspectives. We motivate this study through a pilot study, revealing the large portion (74\\\\%) of unpaid crowdworkers\'\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Software Engineering","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f93ad8e338e5b6446da42","authors":["Yuanchun Li","Jiayi Hua","Haoyu Wang","Chunyang Chen","Yunxin Liu"],"title":"DeepPayload: Black-box Backdoor Attack on Deep Learning Models through Neural Payload Injection","link":"https://arxiv.org/pdf/2101.06896","description":"Deep learning models are increasingly used in mobile applications as critical components. Unlike the program bytecode whose vulnerabilities and threats have been widely-discussed, whether and how the deep learning models deployed in the applications can be compromised are not well-understood since neural networks are usually viewed as a black box. In this paper, we introduce a highly practical backdoor attack achieved with a set of reverse-engineering techniques over compiled deep learning models. The core of the attack is a neural conditional branch constructed with a trigger detector and several operators and injected into the victim model as a malicious payload. The attack is effective as the conditional logic can be flexibly customized by the attacker, and scalable as it does not require any prior knowledge from the original model. We evaluated the attack effectiveness using 5 state-of-the-art deep\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"CONFERENCE","categoryTitle":"43rd International Conference on Software Engineering (ICSE)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f93ad8e338e5b6446da3f","authors":["Han Wang","Chunyang Chen","Zhenchang Xing","John Grundy"],"title":"DiffTech: Differencing Similar Technologies from Crowd-Scale Comparison Discussions","link":"","description":"Developers use different technologies for many software development tasks. However, when faced with several technologies with comparable functionalities, it is not easy to select the most appropriate one, as trial and error comparisons among such technologies are time-consuming. Instead, developers can resort to expert articles, read official documents or ask questions in Q&A sites. However, it still remains difficult to get a comprehensive comparison as online information is often fragmented or contradictory. To overcome these limitations, we propose the DiffTech system that exploits crowdsourced discussions from Stack Overflow, and assists technology comparison with an informative summary of different aspects. We first build a large database of comparable technologies in software engineering by mining tags in Stack Overflow. We then locate comparative sentences about comparable technologies with\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Software Engineering","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f93ad8e338e5b6446da3a","authors":["Bo Yang","Zhenchang Xing","Xin Xia","Chunyang Chen","Deheng Ye","Shanping Li"],"title":"Don\u2019t Do That! Hunting Down Visual Design Smells in Complex UIs against Design Guidelines","link":"","description":"Just like code smells in source code, UI design has visual design smells. We study 93 don\u2019t-do-that guidelines in the Material Design, a complex design system created by Google. We find that these don\u2019t-guidelines go far beyond UI aesthetics, and involve seven general design dimensions (layout, typography, iconography, navigation, communication, color, and shape) and four component design aspects (anatomy, placement, behavior, and usage). Violating these guidelines results in visual design smells in UIs (or UI design smells). In a study of 60,756 UIs of 9,286 Android apps, we find that 7,497 UIs of 2,587 apps have at least one violation of some Material Design guidelines. This reveals the lack of developer training and tool support to avoid UI design smells. To fill this gap, we design an automated UI design smell detector (UIS-Hunter) that extracts and validates multi-modal UI information (component\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"CONFERENCE","categoryTitle":"2021 IEEE/ACM 43rd International Conference on Software Engineering (ICSE)","pages":"761-772","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.602Z","updatedAt":"2021-08-08T08:19:57.602Z","year":2021},{"_id":"610f93ad8e338e5b6446da41","authors":["Tianming Zhao","Chunyang Chen","Yuanning Liu","Xiaodong Zhu"],"title":"GUIGAN: Learning to Generate GUI Designs Using Generative Adversarial Networks","link":"https://arxiv.org/pdf/2101.09978","description":"Graphical User Interface (GUI) is ubiquitous in almost all modern desktop software, mobile applications, and online websites. A good GUI design is crucial to the success of the software in the market, but designing a good GUI which requires much innovation and creativity is difficult even to well-trained designers. Besides, the requirement of the rapid development of GUI design also aggravates designers\u2019 working load. So, the availability of various automated generated GUIs can help enhance the design personalization and specialization as they can cater to the taste of different designers. To assist designers, we develop a model GUIGAN to automatically generate GUI designs. Different from conventional image generation models based on image pixels, our GUIGAN is to reuse GUI components collected from existing mobile app GUIs for composing a new design that is similar to natural-language generation. Our\xa0\u2026","yearPublished":"2021","citedBy":1,"category":{"type":"CONFERENCE","categoryTitle":"43rd International Conference on Software Engineering (ICSE)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f93ad8e338e5b6446da3c","authors":["Qiuyuan Chen","Chunyang Chen","Safwat Hassan","Zhengchang Xing","Xin Xia","Ahmed E Hassan"],"title":"How Should I Improve the UI of My App? A Study of User Reviews of Popular Apps in the Google Play","link":"","description":"UI (User Interface) is an essential factor influencing users\u2019 perception of an app. However, it is hard for even professional designers to determine if the UI is good or not for end-users. Users\u2019 feedback (e.g., user reviews in the Google Play) provides a way for app owners to understand how the users perceive the UI. In this article, we conduct an in-depth empirical study to analyze the UI issues of mobile apps. In particular, we analyze more than 3M UI-related reviews from 22,199 top free-to-download apps and 9,380 top non-free apps in the Google Play Store. By comparing the rating of UI-related reviews and other reviews of an app, we observe that UI-related reviews have lower ratings than other reviews. By manually analyzing a random sample of 1,447 UI-related reviews with a 95% confidence level and a 5% interval, we identify 17 UI-related issues types that belong to four categories (i.e., \u201cAppearance\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"ACM Transactions on Software Engineering and Methodology (TOSEM)","pages":"1-38","publisher":"ACM","volume":"30","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f95618e338e5b6446da81","authors":["Anne H Neerincx","Katrine Whiteson","Joann L Phan","Paul Brinkman","Mahmoud I Abdel-Aziz","Els JM Weersink","Josje Altenburg","Christof J Majoor","Anke H Maitland-van der Zee","Lieuwe DJ Bos"],"title":"Lumacaftor/ivacaftor changes the lung microbiome and metabolome in cystic fibrosis patients","link":"https://openres.ersjournals.com/content/7/2/00731-2020.abstract","description":"Rationale\\nTargeted cystic fibrosis (CF) therapy with lumacaftor/ivacaftor partly restores chloride channel function and improves epithelial fluid transport in the airways. Consequently, changes may occur in the microbiome, which is adapted to CF lungs.\\nObjectives\\nTo investigate the effects of lumacaftor/ivacaftor on respiratory microbial composition and microbial metabolic activity by repeatedly sampling the lower respiratory tract.\\nMethods\\nThis was a single-centre longitudinal observational cohort study in adult CF patients with a homozygous Phe508del mutation. Lung function measurements and microbial cultures of sputum were performed as part of routine care. An oral and nasal wash, and a breath sample, were collected before and every 3\u2005months after starting therapy, for up to 12\u2005months.\\nResults\\nTwenty patients were included in this study. Amplicon 16S RNA and metagenomics sequencing revealed that\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"ERJ open research","pages":"","publisher":"European Respiratory Society","volume":"7","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f95618e338e5b6446da84","authors":["Martin I MacDonald","Christian R Osadnik","Lauren Bulfin","Elizabeth Leahy","Paul Leong","Eskandarain Shafuddin","Kais Hamza","Paul T King","Philip G Bardin"],"title":"MULTI-PHACET-MULTIdimensional clinical phenotyping of hospitalised acute COPD ExacerbaTions","link":"https://openres.ersjournals.com/content/erjor/early/2021/04/29/23120541.00198-2021.full.pdf","description":"Background\\nThe generic term \u201cexacerbation\u201d does not reflect the heterogeneity of acute exacerbations of COPD (AECOPD). We utilised a novel algorithmic strategy to profile exacerbation phenotypes based on underlying aetiologies.\\nMethods\\nPatients hospitalised for AECOPD (n=146) were investigated for aetiological contributors summarised in a mnemonic acronym ABCDEFGX (A=Airway virus, B=Bacterial, C=Coinfection, D=Depression/anxiety, E=Eosinophils, F=Failure (cardiac), G=General environment, X=Unknown). Results from clinical investigations were combined to construct AECOPD phenotypes. Relationships to clinical outcomes were examined for both composite phenotypes and their specific aetiological components. Aetiologies identified at exacerbation were reassessed at outpatient follow-up.\\nResults\\nHospitalised AECOPDs were remarkably diverse, with 26 distinct phenotypes identified. Multiple\xa0\u2026","yearPublished":"2021","citedBy":1,"category":{"type":"JOURNAL","categoryTitle":"ERJ Open Research","pages":"","publisher":"European Respiratory Society","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f95618e338e5b6446da83","authors":["Robert Griffiths","Kais Hamza"],"title":"Matching the distributions of the marginals and the sums for the Meixner class","link":"","description":"\u0414\u043b\u044f \u0437\u0430\u0434\u0430\u043d\u043d\u043e\u0433\u043e \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u044b\u0445 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0445 \u0432\u0435\u043b\u0438\u0447\u0438\u043d , \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0449\u0438\u0445 \u043a\u043b\u0430\u0441\u0441\u0443 \u041c\u0435\u0439\u043a\u0441\u043d\u0435\u0440\u0430, \u043d\u0430\u0439\u0434\u0435\u043d\u044b \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0435 \u0432\u0435\u043b\u0438\u0447\u0438\u043d\u044b , \u0434\u043b\u044f \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043c\u0430\u0440\u0433\u0438\u043d\u0430\u043b\u044c\u043d\u044b\u0435 \u0440\u0430\u0441\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0438 \u0440\u0430\u0441\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0441\u0443\u043c\u043c \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u044e\u0442: $ Y_i\\\\stackrel {d}{=} X_i $ \u0438 $\\\\sum_iY_i\\\\stackrel {d}{=}\\\\sum_iX_i $. \u0412 \u0440\u0430\u0431\u043e\u0442\u0435 \u0434\u0430\u0435\u0442\u0441\u044f \u043f\u043e\u043b\u043d\u0430\u044f \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0430\u0446\u0438\u044f \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0445 \u0432\u0435\u043b\u0438\u0447\u0438\u043d  \u0438 \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u0442\u0441\u044f \u043f\u0440\u0438\u043c\u0435\u0440\u044b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0438\u044f \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043a\u043e\u043d\u0435\u0447\u043d\u044b\u0445 \u0441\u0440\u0435\u0434\u043d\u0435\u043a\u0432\u0430\u0434\u0440\u0430\u0442\u0438\u0447\u043d\u044b\u0445 \u0440\u0430\u0437\u043b\u043e\u0436\u0435\u043d\u0438\u0439.","yearPublished":"2021","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"\u0422\u0435\u043e\u0440\u0438\u044f \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0435\u0439 \u0438 \u0435\u0435 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f","pages":"534-551","publisher":"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043d\u0430\u0443\u043a, \u041c\u0430\u0442\u0435\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0438\u043c. \u0412\u0410 \u0421\u0442\u0435\u043a\u043b\u043e\u0432\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a","volume":"66","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f95618e338e5b6446da7f","authors":["P Leong","MI Macdonald","P King","CR Osadnik","BS Ko","K Hamza","KK Lau","JM Troupis","PG Bardin"],"title":"Right Ventricular End Diastolic Volume Influences Outcomes During Hospitalized COPD Exacerbations, and Subsequent Mortality","link":"","description":"INTRODUCTION\\nRight ventricular volumes are crucial outcome determinants in pulmonary disease. Little is known about the influence of right ventricular volumes during hospitalized acute exacerbations of chronic obstructive pulmonary disease (AECOPD). We aimed to ascertain the associations of right ventricular end diastolic volume indexed to body surface area (RVEDVI) during hospitalized AECOPD, and relationship with mortality in long term follow-up.\\nMETHODS\\nProspective observational cohort study (December 2013 to November 2019, ACTRN12617001562369) using dynamic retrospective electrocardiogram-gated CT during hospitalized AECOPD. RVEDVI was defined as normal or high using Framingham Offspring Cohort normative values. Cox regression determined the prognostic relevance of RVEDVI for death.\\nRESULTS\\n148 participants (70\xb110 years (mean\xb1standard deviation), 88 (59%) men\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"BOOK","categoryTitle":"TP41. TP041 DIAGNOSIS AND RISK ASSESSMENT IN COPD","pages":"A2309-A2309","publisher":"American Thoracic Society","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f93ad8e338e5b6446da43","authors":["Yujin Huang","Han Hu","Chunyang Chen"],"title":"Robustness of on-device Models: Adversarial Attack to Deep Learning Models on Android Apps","link":"https://arxiv.org/pdf/2101.04401","description":"Deep learning has shown its power in many applications, including object detection in images, natural-language understanding, and speech recognition. To make it more accessible to end users, many deep learning models are now embedded in mobile apps. Compared to offloading deep learning from smartphones to the cloud, performing machine learning on-device can help improve latency, connectivity, and power consumption. However, most deep learning models within Android apps can easily be obtained via mature reverse engineering, while the models\u2019 exposure may invite adversarial attacks. In this study, we propose a simple but effective approach to hacking deep learning models using adversarial attacks by identifying highly similar pre-trained models from TensorFlow Hub. All 10 real-world Android apps in the experiment are successfully attacked by our approach. Apart from the feasibility of the\xa0\u2026","yearPublished":"2021","citedBy":5,"category":{"type":"CONFERENCE","categoryTitle":"43rd International Conference on Software Engineering","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2021},{"_id":"610f95618e338e5b6446da7e","authors":["Lydia Cvejic","Nadine Guiney","Kenneth K Lau","Paul Finlay","Kais Hamza","Paul Leong","Martin MacDonald","Paul T King","Philip G Bardin"],"title":"Swallow patterns associated with aspiration in COPD: a prospective analysis","link":"https://openres.ersjournals.com/content/erjor/7/3/00170-2021.full.pdf","description":"Few studies have examined swallow of large liquid volumes representative of everyday drinking in COPD. Swallow by cup-drinking was evaluated in COPD using videofluoroscopy. Slower swallow was linked to aspiration indicating altered swallow habits in COPD.https://bit.ly/3wpdnO3","yearPublished":"2021","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"ERJ Open Research","pages":"","publisher":"European Respiratory Society","volume":"7","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f95618e338e5b6446da85","authors":["Paul Leong","Martin I MacDonald","Paul T King","Christian R Osadnik","Brian S Ko","Shane A Landry","Kais Hamza","Ahilan Kugenasan","John M Troupis","Philip G Bardin"],"title":"Treatable cardiac disease in hospitalised COPD exacerbations","link":"https://openres.ersjournals.com/content/7/1/00756-2020.short","description":"Introduction\\nAcute exacerbations of COPD (AECOPD) are accompanied by escalations in cardiac risk superimposed upon elevated baseline risk. Appropriate treatment for coronary artery disease (CAD) and heart failure with reduced ejection fraction (HFrEF) could improve outcomes. However, securing these diagnoses during AECOPD is difficult, so their true prevalence remains unknown, as does the magnitude of this treatment opportunity. We aimed to determine the prevalence of severe CAD and severe HFrEF during hospitalised AECOPD using dynamic computed tomography (CT).\\nMethods\\nA cross-sectional study of 148 patients with hospitalised AECOPD was conducted. Dynamic CT was used to identify severe CAD (Agatston score \u2265400) and HFrEF (left ventricular ejection fraction \u226440% and/or right ventricular ejection fraction \u226435%).\\nResults\\nSevere CAD was detected in 51 of 148 patients (35%), left\xa0\u2026","yearPublished":"2021","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"ERJ Open Research","pages":"","publisher":"European Respiratory Society","volume":"7","issue":"1"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f93ad8e338e5b6446da39","authors":["Bo Yang","Zhenchang Xing","Xin Xia","Chunyang Chen","Deheng Ye","Shanping Li"],"title":"UIS-Hunter: Detecting UI Design Smells in Android Apps","link":"","description":"Similar to code smells in source code, UI design has visual design smells that indicate violations of good UI design guidelines. UI design guidelines constitute design systems for a vast variety of products, platforms, and services. Following a design system, developers can avoid common design issues and pitfalls. However, a design system is often complex, involving various design dimensions and numerous UI components. Lack of concerns on GUI visual effect results in little support for detecting UI design smells that violate the design guidelines in a complex design system. In this paper, we propose an automated UI design smell detector named UIS-Hunter (UI design Smell Hunter). The tool is able to (i) automatically process UI screenshots or prototype files to detect UI design smells and generate reports, (ii) highlight the violated UI regions and list the material design guidelines that the found design smells\xa0\u2026","yearPublished":"2021","citedBy":null,"category":{"type":"CONFERENCE","categoryTitle":"2021 IEEE/ACM 43rd International Conference on Software Engineering: Companion Proceedings (ICSE-Companion)","pages":"89-92","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.602Z","updatedAt":"2021-08-08T08:19:57.602Z","year":2021},{"_id":"610f95618e338e5b6446da82","authors":["Ben Amiet","Andrea Collevecchio","Kais Hamza"],"title":"When \u201cBetter\u201d is better than \u201cBest\u201d","link":"https://arxiv.org/pdf/2011.00239","description":"We consider two-player normal form games where each player has the same finite strategy set. The payoffs of each player are assumed to be i.i.d. random variables with a continuous distribution. We show that, with high probability, the better-response dynamics converges to pure Nash equilibrium whenever there is one, whereas best-response dynamics fails to converge, as it is trapped.","yearPublished":"2021","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Operations Research Letters","pages":"260-264","publisher":"North-Holland","volume":"49","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2021},{"_id":"610f71458e338e5b6446d9e4","authors":["afhgarh"],"title":"asdfasd","yearPublished":"2021","description":"adfhathah","link":"","category":{"type":"BOOK","categoryTitle":"afhnasgn","volume":"atgnatgnag","issue":"nsgngn","pages":"agnagn","publisher":"afgn"},"teamId":"6105283db9496004d4f0b74b","createdAt":"2021-08-08T05:53:09.455Z","updatedAt":"2021-08-08T05:53:09.455Z","__v":0,"year":2021},{"_id":"610f95618e338e5b6446da8b","authors":["Robert Griffiths","Kais Hamza"],"title":"A universal approach to matching marginals and sums","link":"https://projecteuclid.org/journals/electronic-communications-in-probability/volume-25/issue-none/A-universal-approach-to-matching-marginals-and-sums/10.1214/20-ECP357.pdf","description":"For a given set of random variables  we seek as large a family as possible of random variables  such that the marginal laws and the laws of the sums match: $Y_{i}\\\\,{\\\\stackrel {{d }}{=}}\\\\,X_{i}$ and $\\\\sum _{i}Y_{i}\\\\,{\\\\stackrel {{d }}{=}}\\\\,\\\\sum _{i}X_{i}$. Under the assumption that  are identically distributed but not necessarily independent, using a symmetry-balancing approach we provide a universal construction with sufficient symmetry to satisfy the more stringent requirement that, for any symmetric function , $g(Y)\\\\,{\\\\stackrel {{d }}{=}}\\\\,g(X)$. The same ideas are shown to extend to the non-identically but \u201csimilarly\u201d distributed case.","yearPublished":"2020","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"Electron. Commun. Probab.","pages":"","publisher":"","volume":"25","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2020},{"_id":"610f93e58e338e5b6446da6b","authors":["Jie Yen Fan","Kais Hamza","Peter Jagers","Fima Klebaner"],"title":"Convergence of the age structure of general schemes of population processes","link":"https://arxiv.org/pdf/1702.08592","description":"We consider a family of general branching processes with reproduction parameters depending on the age of the individual as well as the population age structure and a parameter , which may represent the carrying capacity. These processes are Markovian in the age structure. In a previous paper (Proc. Steklov Inst. Math.282 (2013) 90\u2013105), the Law of Large Numbers as  was derived. Here we prove the central limit theorem, namely the weak convergence of the fluctuation processes in an appropriate Skorokhod space. We also show that the limit is driven by a stochastic partial differential equation.","yearPublished":"2020","citedBy":5,"category":{"type":"JOURNAL","categoryTitle":"Bernoulli","pages":"893-926","publisher":"Bernoulli Society for Mathematical Statistics and Probability","volume":"26","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2020},{"_id":"61077d1ebee37141f4f136a9","authors":["Kerstin de Wit","Sameer Papira","Sam Schulman","Fred Spencer","Sangita Sharma","Marc Afilalo","Susan Kahn","Gregoire Le Gal","Sudeep P Shivakumar","Shannon M Bates","Cynthia M Wu","Alejandro Lazo-Langner","Frederick D\'Aragon","Jean-Francois Deshaies","Luciana Spadafora","Jim Julian","Clive Kearon"],"title":"Deep Vein Thrombosis Diagnosis with D-Dimer Adjusted to Clinical Probability","link":"","description":"","yearPublished":"2020","citedBy":null,"category":{"type":"CONFERENCE","categoryTitle":"BLOOD","pages":"","publisher":"AMER SOC HEMATOLOGY","volume":"136","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.998Z","updatedAt":"2021-08-02T05:05:34.998Z","year":2020},{"_id":"610f93ad8e338e5b6446da44","authors":["Han Wang","Chunyang Chen","Zhenchang Xing","John Grundy"],"title":"DiffTech: A tool for differencing similar technologies from question-and-answer discussions","link":"","description":"Developers can use different technologies for different software development tasks in their work. However, when faced with several technologies with comparable functionalities, it can be challenging for developers to select the most appropriate one, as trial and error comparisons among such technologies are time-consuming. Instead, developers resort to expert articles, read official documents or ask questions in Q&A sites for technology comparison. However, it is still very opportunistic whether they will get a comprehensive comparison, as online information is often fragmented, contradictory and biased. To overcome these limitations, we propose the DiffTech system that exploits the crowd sourced discussions from Stack Overflow, and assists technology comparison with an informative summary of different comparison aspects. We found 19,118 comparative sentences from 2,410 pairs of comparable technologies\xa0\u2026","yearPublished":"2020","citedBy":1,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 28th ACM Joint Meeting on European Software Engineering Conference and Symposium on the Foundations of Software Engineering","pages":"1576-1580","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"61077d1ebee37141f4f136ad","authors":["AJ Comerota","C Kearon","CS Gu","JA Julian","SZ Goldhaber","SR Kahn"],"title":"Endovascular Thrombus Removal for Acute Iliofemoral Deep Vein Thrombosis","link":"","description":"Conclusions\\nThis subanalysis of the 391 patients from the ATTRACT Trial (URL: https://bloodclotstudy. wustl. edu/attract/; unique identifier: NCT00790335) found that pharmacomechanical catheter-directed thrombolysis (PCDT) improved acute leg symptoms at 30-days as well as decreased the severity of post-thrombotic syndrome (PTS).\\nSummary\\nThe ATTRACT Trial did not show a difference in the effect of PCDT on the occurrence of PTS at 2 years. However, this secondary analysis shows a greater decrease in acute leg swelling and pain in patients treated with PCDT compared with anticoagulation alone as well as a reduced PTS severity, reduced percentage with moderate to severe PTS, and improvement in venous disease-specific quality of life (Villata scale) through 24 months.","yearPublished":"2020","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Journal of Vascular Surgery: Venous and Lymphatic Disorders","pages":"306-307","publisher":"Elsevier","volume":"8","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.998Z","updatedAt":"2021-08-02T05:05:34.998Z","year":2020},{"_id":"610f93ad8e338e5b6446da47","authors":["Chunyang Chen","Sidong Feng","Zhengyang Liu","Zhenchang Xing","Shengdong Zhao"],"title":"From Lost to Found: Discover Missing UI Design Semantics through Recovering Missing Tags","link":"https://dl.acm.org/doi/pdf/10.1145/3415194","description":"Design sharing sites provide UI designers with a platform to share their works and also an opportunity to get inspiration from others\' designs. To facilitate management and search of millions of UI design images, many design sharing sites adopt collaborative tagging systems by distributing the work of categorization to the community. However, designers often do not know how to properly tag one design image with compact textual description, resulting in unclear, incomplete, and inconsistent tags for uploaded examples which impede retrieval, according to our empirical study and interview with four professional designers. Based on a deep neural network, we introduce a novel approach for encoding both the visual and textual information to recover the missing tags for existing UI examples so that they can be more easily found by text queries. We achieve 82.72% accuracy in the tag prediction. Through a simulation\xa0\u2026","yearPublished":"2020","citedBy":9,"category":{"type":"JOURNAL","categoryTitle":"Proceedings of the ACM on Human-Computer Interaction","pages":"123:1-123:22","publisher":"ACM","volume":"4","issue":"CSCW2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"610f95618e338e5b6446da89","authors":["A Collevecchio","K Hamza","M Shi","RJ Williams"],"title":"General boostrap random walks","link":"https://arxiv.org/pdf/2010.16000","description":"Given the increments of a simple symmetric random walk , we exhibit the most general way of recycling these increments into a simple symmetric random walk  adapted to the filtration of . We study the long term behaviour of a suitably normalized two-dimensional process. In particular, we provide necessary and sufficient conditions for the process to converge to a two-dimensional Brownian motion (possibly degenerate). We also discuss cases in which the limit is not Gaussian.","yearPublished":"2020","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:2010.16000","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2020},{"_id":"610f95618e338e5b6446da8a","authors":["Paul Leong","Laurence E Ruane","Debra Phyland","Joo Koh","Martin I MacDonald","Malcom Baxter","Kenneth K Lau","Kais Hamza","Philip G Bardin"],"title":"Inspiratory vocal cord closure in COPD","link":"","description":"Inspiratory vocal cord closure is surprisingly prevalent in COPD http://bit.ly/2TVHMn0","yearPublished":"2020","citedBy":1,"category":{"type":"JOURNAL","categoryTitle":"European Respiratory Journal","pages":"","publisher":"European Respiratory Society","volume":"55","issue":"5"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2020},{"_id":"61077d1ebee37141f4f136ab","authors":["MK Krzyzanowska","J Julian","CS Gu","M Powis","Q Li","KA Enright","D Howell","C Earle","S Gandhi","S Rask","C Brezden-Masley","SF Dent","L Hajra","O Freedman","S Spadafora","C Hamm","N Califaretti","M Trudeau","M Levine","E Grunfeld"],"title":"LBA87 A pragmatic cluster-randomized trial of ambulatory toxicity management in patients receiving adjuvant or neo-adjuvant chemotherapy for early stage breast cancer (AToM)","link":"","description":"Background\\nEmergency department visits and hospitalizations (EDH) are common during chemotherapy (CH). EDH may be preventable with adequate support between CH visits but large-scale evaluations of virtual supportive care are limited.\\nMethods\\nWe undertook a pragmatic, cluster-randomized trial to examine the effectiveness of pro-active telephone management of toxicities in early stage breast cancer (BC) patients receiving CH at 20 cancer centres in Ontario, Canada. Centres were allocated using a covariate-constrained approach to standardized, nurse-led calls to assess common toxicities at 2 time points following each cycle (intervention), or routine care (control). Participants were all patients with stage I-III BC commencing adjuvant or neo-adjuvant CH at participating centres during the centre recruitment period. A subset of 25 patients from each centre completed patient-reported outcome questionnaires\xa0\u2026","yearPublished":"2020","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Annals of Oncology","pages":"S1214","publisher":"Elsevier","volume":"31","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.998Z","updatedAt":"2021-08-02T05:05:34.998Z","year":2020},{"_id":"61079b71de2e9a6f2cdf8800","authors":["Jie Yen Fan","Kais Hamza","Peter Jagers","Fima C Klebaner"],"title":"Limit theorems for multi-type general branching processes with population dependence","link":"https://arxiv.org/pdf/1903.04747","description":"A general multi-type population model is considered, where individuals live and reproduce according to their age and type, but also under the influence of the size and composition of the entire population. We describe the dynamics of the population as a measure-valued process and obtain its asymptotics as the population grows with the environmental carrying capacity. Thus, a deterministic approximation is given, in the form of a law of large numbers, as well as a central limit theorem. This general framework is then adapted to model sexual reproduction, with a special section on serial monogamic mating systems.","yearPublished":"2020","citedBy":1,"category":{"type":"JOURNAL","categoryTitle":"Advances in Applied Probability","pages":"1127-1163","publisher":"Cambridge University Press","volume":"52","issue":"4"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T07:14:57.464Z","updatedAt":"2021-08-02T07:14:57.464Z","year":2020},{"_id":"610f95618e338e5b6446da88","authors":["ANDREA Collevecchio","KAIS Hamza","TUAN-MINH Nguyen"],"title":"Long range one-cookie random walk with positive speed","link":"https://arxiv.org/pdf/2011.00493","description":"We study a one-dimensional excited random walks with non-nearest neighbor jumps. When the process is at a vertex that has not been visited before, its next transition has a positive drift to the right, possibly with long jumps. Whenever the process visits a vertex that has already been visited in the past, its next transition is the one of a simple symmetric random walk. We give a sufficient condition for the process to have positive speed.","yearPublished":"2020","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:2011.00493","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2020},{"_id":"610f95618e338e5b6446da87","authors":["Kais Hamza"],"title":"Matching marginals and sums","link":"https://www.liverpool.ac.uk/media/livacuk/ifam/pdfdocuments/Liverpool2020.pdf","description":"\u25b6 Sum of two independent N (0, 1) is N (0, 2).\u25b6 L\xe9vy-Cram\xe9r. The sum of two independent non-constant random variables is normally distributed if and only if each of the summands is normally distributed.\u25b6 Raikov. The sum of two independent non-constant random variables is Poisson distributed if and only if each of the summands is Poisson distributed.\u25b6 Linnik. If a law is composed of a normal law and a Poisson type one, so are all its components.","yearPublished":"2020","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.296Z","updatedAt":"2021-08-08T08:27:13.296Z","year":2020},{"_id":"610f93ad8e338e5b6446da48","authors":["Jieshan Chen","Mulong Xie","Zhenchang Xing","Chunyang Chen","Xiwei Xu","Liming Zhu"],"title":"Object Detection for Graphical User Interface: Old Fashioned or Deep Learning or a Combination?","link":"https://arxiv.org/pdf/2008.05132","description":"Detecting Graphical User Interface (GUI) elements in GUI images is a domain-specific object detection task. It supports many software engineering tasks, such as GUI animation and testing, GUI search and code generation. Existing studies for GUI element detection directly borrow the mature methods from computer vision (CV) domain, including old fashioned ones that rely on traditional image processing features (eg, canny edge, contours), and deep learning models that learn to detect from large-scale GUI data. Unfortunately, these CV methods are not originally designed with the awareness of the unique characteristics of GUIs and GUI elements and the high localization accuracy of the GUI element detection task. We conduct the first large-scale empirical study of seven representative GUI element detection methods on over 50k GUI images to understand the capabilities, limitations and effective designs of these\xa0\u2026","yearPublished":"2020","citedBy":18,"category":{"type":"CONFERENCE","categoryTitle":"(ESEC/FSE) ACM Joint European Software Engineering Conference and Symposium on the Foundations of Software Engineering","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"610f93ad8e338e5b6446da46","authors":["Zhe Liu","Chunyang Chen","Junjie Wang","Yuekai Huang","Jun Hu","Qing Wang"],"title":"Owl Eyes: Spotting UI Display Issues via Visual Understanding","link":"https://arxiv.org/pdf/2009.01417","description":"Graphical User Interface (GUI) provides a visual bridge between a software application and end users, through which they can interact with each other. With the development of technology and aesthetics, the visual effects of the GUI are more and more attracting. However, such GUI complexity posts a great challenge to the GUI implementation. According to our pilot study of crowdtesting bug reports, display issues such as text overlap, blurred screen, missing image always occur during GUI rendering on different devices due to the software or hardware compatibility. They negatively influence the app usability, resulting in poor user experience. To detect these issues, we propose a novel approach, OwlEye, based on deep learning for modelling visual information of the GUI screenshot. Therefore, OwlEye can detect GUIs with display issues and also locate the detailed region of the issue in the given GUI for guiding\xa0\u2026","yearPublished":"2020","citedBy":6,"category":{"type":"CONFERENCE","categoryTitle":"2020 35th IEEE/ACM International Conference on Automated Software Engineering (ASE)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"61077d1ebee37141f4f136aa","authors":["Clive Kearon","Marc Carrier","Chu-Shu Gu","Sam Schulman","Shannon M Bates","Susan R Kahn","Isabelle Chagnon","Doan Trang Nguyen","Cynthia Wu","Lisa Rudd-Scott","Jim A Julian"],"title":"Rivaroxaban compared to placebo for the treatment of leg superficial vein thrombosis: a randomized trial","link":"","description":"The role of rivaroxaban in the treatment of leg superficial venous thrombosis (SVT) is uncertain. This article aims to determine if rivaroxaban is an effective and safe treatment for leg SVT. Patients with symptomatic leg SVT of at least 5\u2009cm length were randomized to 45 days of rivaroxaban 10\u2009mg daily or to placebo, and followed for a total of 90 days. Treatment failure (required a nonstudy anticoagulant; had proximal deep vein thrombosis or pulmonary embolism; or had surgery for SVT) at 90 days was the primary efficacy outcome. Secondary efficacy outcomes included leg pain severity, and venous disease-specific and general health-related quality of life over 90 days. Major bleeding at 90 days was the primary safety outcome. Poor enrollment led to the trial being stopped after 85 of the planned 600 patients were randomized to rivaroxaban (n\u2009=\u200943) or placebo (n\u2009=\u200942). One rivaroxaban and five placebo\xa0\u2026","yearPublished":"2020","citedBy":1,"category":{"type":"OTHER","categoryTitle":"","pages":"977-985","publisher":"Thieme Medical Publishers, Inc.","volume":"46","issue":"08"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.998Z","updatedAt":"2021-08-02T05:05:34.998Z","year":2020},{"_id":"610f93ad8e338e5b6446da4b","authors":["Dehai Zhao","Zhenchang Xing","Chunyang Chen","Xiwei Xu","Liming Zhu","Guoqiang Li","Jinshui Wang"],"title":"Seenomaly: vision-based linting of GUI animation effects against design-don\'t guidelines","link":"","description":"GUI animations, such as card movement, menu slide in/out, snack-bar display, provide appealing user experience and enhance the usability of mobile applications. These GUI animations should not violate the platform\'s UI design guidelines (referred to as design-don\'t guideline in this work) regarding component motion and interaction, content appearing and disappearing, and elevation and shadow changes. However, none of existing static code analysis, functional GUI testing and GUI image comparison techniques can \u201csee\u201d the GUI animations on the scree, and thus they cannot support the linting of GUI animations against design-don\'t guidelines. In this work, we formulate this GUI animation linting problem as a multi-class screencast classification task, but we do not have sufficient labeled GUI animations to train the classifier. Instead, we propose an unsupervised, computer-vision based adversarial\xa0\u2026","yearPublished":"2020","citedBy":14,"category":{"type":"CONFERENCE","categoryTitle":"42nd International Conference on Software Engineering (ICSE\u201920). ACM, New York, NY","pages":"1286 - 1297","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2020},{"_id":"610f93ad8e338e5b6446da4c","authors":["Chunyang Chen"],"title":"SimilarAPI: Mining Analogical APIs for Library Migration","link":"","description":"Establishing API mappings between libraries is a prerequisite step for library migration tasks. Manually establishing API mappings is tedious due to the large number of APIs to be examined, and existing methods based on supervised learning requires unavailable already-ported or functionality similar applications. Therefore, we propose an unsupervised deep learning based approach to embed both API usage semantics and API description (name and document) semantics into vector space for inferring likely analogical API mappings between libraries. We implement a proof-of-concept website SimilarAPI (https://similarapi.appspot.com) which can recommend analogical APIs for 583,501 APIs of 111 pairs of analogical Java libraries with diverse functionalities. Video: https://youtu.be/EAwD6l24vLQ","yearPublished":"2020","citedBy":3,"category":{"type":"CONFERENCE","categoryTitle":"International Conference on Software Engineering (ICSE), Demo Track","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2020},{"_id":"610f93ad8e338e5b6446da45","authors":["Mulong Xie","Sidong Feng","Zhenchang Xing","Jieshan Chen","Chunyang Chen"],"title":"UIED: a hybrid tool for GUI element detection","link":"https://www.researchgate.net/profile/Mulong-Xie/publication/346170544_UIED_a_hybrid_tool_for_GUI_element_detection/links/5fbca13a458515b797641b72/UIED-a-hybrid-tool-for-GUI-element-detection.pdf","description":"Graphical User Interface (GUI) elements detection is critical for many GUI automation and GUI testing tasks. Acquiring the accurate positions and classes of GUI elements is also the very first step to conduct GUI reverse engineering or perform GUI testing. In this paper, we implement a User Iterface Element Detection (UIED), a toolkit designed to provide user with a simple and easy-to-use platform to achieve accurate GUI element detection. UIED integrates multiple detection methods including old-fashioned computer vision (CV) approaches and deep learning models to handle diverse and complicated GUI images. Besides, it equips with a novel customized GUI element detection methods to produce state-of-the-art detection results. Our tool enables the user to change and edit the detection result in an interactive dashboard. Finally, it exports the detected UI elements in the GUI image to design files that can be\xa0\u2026","yearPublished":"2020","citedBy":4,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 28th ACM Joint Meeting on European Software Engineering Conference and Symposium on the Foundations of Software Engineering","pages":"1655-1659","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"610f93ad8e338e5b6446da4a","authors":["Jieshan Chen","Chunyang Chen","Zhenchang Xing","Xiwei Xu","Liming Zhu","Guoqiang Li","Jinshui Wang"],"title":"Unblind Your Apps: Predicting Natural-Language Labels for Mobile GUI Components by Deep Learning","link":"https://arxiv.org/pdf/2003.00380","description":"According to the World Health Organization(WHO), it is estimated that approximately 1.3 billion people live with some forms of vision impairment globally, of whom 36 million are blind. Due to their disability, engaging these minority into the society is a challenging problem. The recent rise of smart mobile phones provides a new solution by enabling blind users\' convenient access to the information and service for understanding the world. Users with vision impairment can adopt the screen reader embedded in the mobile operating systems to read the content of each screen within the app, and use gestures to interact with the phone. However, the prerequisite of using screen readers is that developers have to add natural-language labels to the image-based components when they are developing the app. Unfortunately, more than 77% apps have issues of missing labels, according to our analysis of 10,408 Android\xa0\u2026","yearPublished":"2020","citedBy":25,"category":{"type":"CONFERENCE","categoryTitle":"42nd International Conference on Software Engineering (ICSE\u201920)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2020},{"_id":"610f93ad8e338e5b6446da49","authors":["Jieshan Chen","Chunyang Chen","Zhenchang Xing","Xin Xia","Liming Zhu","John Grundy","Jinshui Wang"],"title":"Wireframe-based UI design search through image autoencoder","link":"https://arxiv.org/pdf/2103.07085","description":"UI design is an integral part of software development. For many developers who do not have much UI design experience, exposing them to a large database of real-application UI designs can help them quickly build up a realistic understanding of the design space for a software feature and get design inspirations from existing applications. However, existing keyword-based, image-similarity-based, and component-matching-based methods cannot reliably find relevant high-fidelity UI designs in a large database alike to the UI wireframe that the developers sketch, in face of the great variations in UI designs. In this article, we propose a deep-learning-based UI design search engine to fill in the gap. The key innovation of our search engine is to train a wireframe image autoencoder using a large database of real-application UI designs, without the need for labeling relevant UI designs. We implement our approach for\xa0\u2026","yearPublished":"2020","citedBy":12,"category":{"type":"JOURNAL","categoryTitle":"ACM Transactions on Software Engineering and Methodology (TOSEM)","pages":"1-31","publisher":"ACM","volume":"29","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.603Z","updatedAt":"2021-08-08T08:19:57.603Z","year":2020},{"_id":"610f95618e338e5b6446da95","authors":["Lauren C Wolfram","Roberto F Weinberg","Oliver Nebel","Kais Hamza","Pavl\xedna Hasalov\xe1","Jitka M\xedkov\xe1","Raul Becchio"],"title":"A 60-Myr record of continental back-arc differentiation through cyclic melting","link":"","description":"Continental crust forms and evolves above subduction zones as a result of heat and mass transfer from the mantle below. The nature and extent of this transfer remain debated. Although it has been recognized that arc magmatism at active continental margins can be cyclical at 50-to 1-Myr timescales, such cyclicity has not been recognized in the back-arc. Here we investigate the melting of sedimentary rocks in the continental back-arc of the western Gondwana margin during the Cambrian\u2013Ordovician Famatinian orogeny of Northwest Argentina. We determine the U\u2212 Pb ages of zircons that formed during crustal melting and find that they range from 505 to 440 million years ago, concentrated into age groups spaced by 10\u201315 Myr. This suggests multiple and cyclical melting events in the continental back-arc, which matches the more than 60 Myr duration of the magmatic activity in the arc and demonstrates that\xa0\u2026","yearPublished":"2019","citedBy":28,"category":{"type":"JOURNAL","categoryTitle":"Nature Geoscience","pages":"215-219","publisher":"Nature Publishing Group","volume":"12","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f95618e338e5b6446da96","authors":["Andrea Collevecchio","Kais Hamza","Laurent Tournier"],"title":"A deterministic walk on the randomly oriented Manhattan lattice","link":"https://projecteuclid.org/journals/electronic-journal-of-probability/volume-24/issue-none/A-deterministic-walk-on-the-randomly-oriented-Manhattan-lattice/10.1214/19-EJP385.pdf","description":"Consider a randomly-oriented two dimensional Manhattan lattice where each horizontal line and each vertical line is assigned, once and for all, a random direction by flipping independent and identically distributed coins. A deterministic walk is then started at the origin and at each step moves diagonally to the nearest vertex in the direction of the horizontal and vertical lines of the present location. This definition can be generalized, in a natural way, to larger dimensions, but we mainly focus on the two dimensional case. In this context the process localizes on two vertices at all large times, almost surely. We also provide estimates for the tail of the length of paths, when the walk is defined on the two dimensional lattice. In particular, the probability of the path to be larger than  decays sub-exponentially in . It is easy to show that higher dimensional paths may not localize on two vertices but will still eventually become\xa0\u2026","yearPublished":"2019","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Electronic Journal of Probability","pages":"1-20","publisher":"Institute of Mathematical Statistics and Bernoulli Society","volume":"24","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da53","authors":["Sa Gao","Chunyang Chen","Zhenchang Xing","Yukun Ma","Wen Song","Shang-Wei Lin"],"title":"A neural model for method name generation from functional description","link":"","description":"The names of software artifacts, e.g., method names, are important for software understanding and maintenance, as good names can help developers easily understand others\' code. However, the existing naming guidelines are difficult for developers, especially novices, to come up with meaningful, concise and compact names for the variables, methods, classes and files. With the popularity of open source, an enormous amount of project source code can be accessed, and the exhaustiveness and instability of manually naming methods could now be relieved by automatically learning a naming model from a large code repository. Nevertheless, building a comprehensive naming system is still challenging, due to the gap between natural language functional descriptions and method names. Specifically, there are three challenges: how to model the relationship between the functional descriptions and formal method\xa0\u2026","yearPublished":"2019","citedBy":17,"category":{"type":"CONFERENCE","categoryTitle":"2019 IEEE 26th International Conference on Software Analysis, Evolution and Reengineering (SANER)","pages":"414-421","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"61077d1ebee37141f4f136b9","authors":["AJ Comerota","C Kearon","CS Gu","JA Julian","SZ Goldhaber","SR Kahn"],"title":"ATTRACT Trial Investigators. Endovascular thrombus removal for acute iliofemoral deep vein thrombosis","link":"","description":"","yearPublished":"2019","citedBy":8,"category":{"type":"JOURNAL","categoryTitle":"Circulation","pages":"1162-73","publisher":"","volume":"139","issue":"9"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2019},{"_id":"61077d1ebee37141f4f136b7","authors":["T Whelan","J Julian","M Levine","T Berrang","DH Kim","CS Gu","I Germain","A Nichol","M Akra","S Lavertu","F Germain","A Fyles","T Trotter","F Perera","S Balkwill","S Chafe","T McGowan","T Muanza","W Beckham","B Chua","I Olivotto"],"title":"Abstract GS4-03: RAPID: A randomized trial of accelerated partial breast irradiation using 3-dimensional conformal radiotherapy (3D-CRT)","link":"","description":"Background\\nWhole breast irradiation (WBI) after lumpectomy reduces the risk of local recurrence, thereby avoiding subsequent mastectomy. It is a key component of breast conserving therapy. WBI is usually given in daily fractions over 3-6 weeks. With accelerated partial breast irradiation (APBI), radiation is delivered over a week or less to the surgical cavity with a margin of normal tissue. It was introduced to provide treatment in a shorter more convenient form. 3D-CRT is an attractive approach as it is non-invasive and uses standard techniques for external beam RT that are widely available. The objective of the RAPID trial was to determine if APBI using 3D-CRT was not inferior to WBI following breast conserving surgery (BCS).\\nMethods\\nWomen \u226540 years of age with axillary node-negative invasive ductal carcinoma, or ductal carcinoma in situ (DCIS) \u22643cm treated by BCS with clear margins of excision were eligible\xa0\u2026","yearPublished":"2019","citedBy":29,"category":{"type":"OTHER","categoryTitle":"","pages":"GS4-03-GS4-03","publisher":"American Association for Cancer Research","volume":"79","issue":"4 Supplement"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2019},{"_id":"610f93ad8e338e5b6446da57","authors":["Dehai Zhao","Zhenchang Xing","Chunyang Chen","Xin Xia","Guoqiang Li"],"title":"ActionNet: Vision-based Workflow Action Recognition From Programming Screencasts","link":"","description":"Programming screencasts have two important applications in software engineering context: study developer behaviors, information needs and disseminate software engineering knowledge. Although programming screencasts are easy to produce, they are not easy to analyze or index due to the image nature of the data. Existing techniques extract only content from screencasts, but ignore workflow actions by which developers accomplish programming tasks. This significantly limits the effective use of programming screencasts in downstream applications. In this paper, we are the first to present a novel technique for recognizing workflow actions in programming screencasts. Our technique exploits image differencing and Convolutional Neural Network (CNN) to analyze the correspondence and change of consecutive frames, based on which nine classes of frequent developer actions can be recognized from\xa0\u2026","yearPublished":"2019","citedBy":14,"category":{"type":"CONFERENCE","categoryTitle":"ACM/IEEE International Conference on Software Engineering (ICSE)","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2019},{"_id":"61077d1ebee37141f4f136b0","authors":["Monika K Krzyzanowska","Jim A Julian","Melanie Powis","Doris Howell","Craig C Earle","Katherine A Enright","Nicole Mittmann","Maureen E Trudeau","Eva Grunfeld"],"title":"Ambulatory Toxicity Management (AToM) in patients receiving adjuvant or neo-adjuvant chemotherapy for early stage breast cancer-a pragmatic cluster randomized trial protocol","link":"https://bmccancer.biomedcentral.com/articles/10.1186/s12885-019-6099-x","description":"Population-based studies suggest that emergency department visits and hospitalizations are common among patients receiving chemotherapy and that rates in routine practice are higher than expected from clinical trials. Chemotherapy-related toxicities are often predictable and, consequently, acute care visits may be preventable with adequate treatment planning and support between visits to the cancer centre. We will evaluate the impact of proactive telephone-based toxicity management on emergency department visits and hospitalizations in women with early stage breast cancer receiving chemotherapy. In this pragmatic covariate constraint-based cluster randomized trial, 20 centres in Ontario, Canada are randomly allocated to either proactive telephone toxicity management (intervention) or routine care (control). The primary outcome is the cluster-level mean number of ED\u2009+\u2009H visits per patient evaluated using Ontario administrative healthcare data. Participants are all patients with early stage (I-III) breast cancer commencing adjuvant or neo-adjuvant chemotherapy at participating institutions during the intervention period. At least 25 patients at each centre participate in a patient reported outcomes sub-study involving the collection of standardized questionnaires to measure: severity of treatment toxicities, self-care, self-efficacy, quality of life, and coordination of care. Patients participating in the patient reported outcomes (PRO) sub-study are asked to provide written consent to link their PRO data to administrative data. Unit costs will be applied to each per person resource utilized, and a total cost per population and patient will be generated\xa0\u2026","yearPublished":"2019","citedBy":5,"category":{"type":"JOURNAL","categoryTitle":"BMC cancer","pages":"1-10","publisher":"BioMed Central","volume":"19","issue":"1"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.999Z","updatedAt":"2021-08-02T05:05:34.999Z","year":2019},{"_id":"61077d1ebee37141f4f136b2","authors":["Elizabeth A Magnuson","Khaja Chinnakondepalli","Katherine Vilain","Clive Kearon","Jim A Julian","Susan R Kahn","Samuel Z Goldhaber","Michael R Jaff","Andrei L Kindzelski","Kevin Herman","Paul S Brady","Karun Sharma","Carl M Black","Suresh Vedantham","David J Cohen"],"title":"Cost-effectiveness of pharmacomechanical catheter-directed thrombolysis versus standard anticoagulation in patients with proximal deep vein thrombosis: results from the ATTRACT\xa0\u2026","link":"https://www.ahajournals.org/doi/pdf/10.1161/CIRCOUTCOMES.119.005659","description":"Background:\\nIn patients with acute deep vein thrombosis (DVT), pharmacomechanical catheter-directed thrombolysis (PCDT) in conjunction with anticoagulation therapy is increasingly used with the goal of preventing postthrombotic syndrome. Long-term costs and cost-effectiveness of these 2 treatment strategies from the perspective of the US healthcare system have not been compared.\\nMethods and Results:\\nBetween 2009 and 2014, the ATTRACT trial (Acute Venous Thrombosis: Thrombus Removal With Adjunctive Catheter-Directed Thrombolysis) randomized 692 patients with acute proximal DVT to PCDT plus anticoagulation (n=337) or standard treatment with anticoagulation alone (n=355). Costs (2017 US dollars) were assessed over a 24-month follow-up period using a combination of resource-based costing, hospital bills, Medicare reimbursement rates, and the Drug Topics Red Book. Health state\xa0\u2026","yearPublished":"2019","citedBy":7,"category":{"type":"JOURNAL","categoryTitle":"Circulation: Cardiovascular Quality and Outcomes","pages":"e005659","publisher":"Lippincott Williams & Wilkins","volume":"12","issue":"10"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.999Z","updatedAt":"2021-08-02T05:05:34.999Z","year":2019},{"_id":"61077d1ebee37141f4f136b1","authors":["Clive Kearon","Kerstin de Wit","Sameer Parpia","Sam Schulman","Marc Afilalo","Andrew Hirsch","Frederick A Spencer","Sangita Sharma","Fr\xe9d\xe9rick D\u2019Aragon","Jean-Fran\xe7ois Deshaies","Gregoire Le Gal","Alejandro Lazo-Langner","Cynthia Wu","Lisa Rudd-Scott","Shannon M Bates","Jim A Julian"],"title":"Diagnosis of Pulmonary Embolism with d-Dimer Adjusted to Clinical Probability","link":"https://www.nejm.org/doi/full/10.1056/NEJMoa1909159","description":"Background Retrospective analyses suggest that pulmonary embolism is ruled out by a d-dimer level of less than 1000 ng per milliliter in patients with a low clinical pretest probability (C-PTP) and by a d-dimer level of less than 500 ng per milliliter in patients with a moderate C-PTP. Methods We performed a prospective study in which pulmonary embolism was considered to be ruled out without further testing in outpatients with a low C-PTP and a d-dimer level of less than 1000 ng per milliliter or with a moderate C-PTP and a d-dimer level of less than 500 ng per milliliter. All other patients underwent chest imaging (usually computed tomographic pulmonary angiography). If pulmonary embolism was not diagnosed, patients did not receive anticoagulant therapy. All patients were followed for 3 months to detect venous thromboembolism. Results A total of 2017 patients were enrolled and evaluated, of whom 7.4% had\xa0\u2026","yearPublished":"2019","citedBy":89,"category":{"type":"JOURNAL","categoryTitle":"New England Journal of Medicine","pages":"2125-2134","publisher":"Massachusetts Medical Society","volume":"381","issue":"22"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.999Z","updatedAt":"2021-08-02T05:05:34.999Z","year":2019},{"_id":"610f93ad8e338e5b6446da4d","authors":["Xu Wang","Chunyang Chen","Zhenchang Xing"],"title":"Domain-specific machine translation with recurrent neural network for software localization","link":"","description":"Software localization is the process of adapting a software product to the linguistic, cultural and technical requirements of a target market. It allows software companies to access foreign markets that would be otherwise difficult to penetrate. Many studies have been carried out to locate need-to-translate strings in software and adapt UI layout after text translation in the new language. However, no work has been done on the most important and time-consuming step of software localization process, i.e., the translation of software text. Due to some unique characteristics of software text, for example, application-specific meanings, context-sensitive translation, domain-specific rare words, general machine translation tools such as Google Translate cannot properly address linguistic and technical nuance in translating software text for software localization. In this paper, we propose a neural-network based translation model\xa0\u2026","yearPublished":"2019","citedBy":16,"category":{"type":"JOURNAL","categoryTitle":"Empirical Software Engineering","pages":"3514-3545","publisher":"Springer US","volume":"24","issue":"6"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f95618e338e5b6446da93","authors":["Rongju Zhang","Nicolas Langren\xe9","Yu Tian","Zili Zhu","Fima Klebaner","Kais Hamza"],"title":"Dynamic portfolio optimization with liquidity cost and market impact: a simulation-and-regression approach","link":"https://arxiv.org/pdf/1610.07694","description":"We present a simulation-and-regression method for solving dynamic portfolio optimization problems in the presence of general transaction costs, liquidity costs and market impact. This method extends the classical least squares Monte Carlo algorithm to incorporate switching costs, corresponding to transaction costs and transient liquidity costs, as well as multiple endogenous state variables, namely the portfolio value and the asset prices subject to permanent market impact. To handle endogenous state variables, we adapt a control randomization approach to portfolio optimization problems and further improve the numerical accuracy of this technique for the case of discrete controls. We validate our modified numerical method by solving a realistic cash-and-stock portfolio with a power-law liquidity model. We identify the certainty equivalent losses associated with ignoring liquidity effects, and illustrate how our\xa0\u2026","yearPublished":"2019","citedBy":18,"category":{"type":"JOURNAL","categoryTitle":"Quantitative Finance","pages":"519-532","publisher":"Routledge","volume":"19","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da50","authors":["Suyu Ma","Zhenchang Xing","Chunyang Chen","Cheng Chen","Lizhen Qu","Guoqiang Li"],"title":"Easy-to-deploy API extraction by multi-level feature embedding and transfer learning","link":"","description":"Application Programming Interfaces (APIs) have been widely discussed on social-technical platforms (e.g., Stack Overflow). Extracting API mentions from such informal software texts is the prerequisite for API-centric search and summarization of programming knowledge. Machine learning based API extraction has demonstrated superior performance than rule-based methods in informal software texts that lack consistent writing forms and annotations. However, machine learning based methods have a significant overhead in preparing training data and effective features. In this paper, we propose a multi-layer neural network based architecture for API extraction. Our architecture automatically learns character-, word- and sentence-level features from the input texts, thus removing the need for manual feature engineering and the dependence on advanced features (e.g., API gazzetter) beyond the input texts. We also\xa0\u2026","yearPublished":"2019","citedBy":14,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Software Engineering","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"61077d1ebee37141f4f136ba","authors":["Jim A Julian","Samuel Z Goldhaber"],"title":"Endovascular Thrombus Removal for Acute","link":"","description":"\u06a9\u062a\u0627\u0628\u062e\u0627\u0646\u0647 \u0627\u0644\u06a9\u062a\u0631\u0648\u0646\u06cc\u06a9 \u0627\u0631\u062a\u0642\u0627\u0621 \u0645\u0633\u062a\u0645\u0631 \u06a9\u0645\u06cc \u0648\u06a9\u06cc\u0641\u06cc \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u06a9\u062a\u0627\u0628\u062f\u0627\u0631\u06cc \u0648 \u0627\u0637\u0644\u0627\u0639 \u0631\u0633\u0627\u0646\u06cc \u0628\u0647 \u0645\u0631\u0627\u062c\u0647 \u06a9\u0646\u0646\u062f\u06af\u0627\u0646 \u062f\u0631 \u0627\u0645\u0631 \u0622\u0645\u0648\u0632\u0634 \u0648\u067e\u0698\u0648\u0647\u0634 \u0628\u0648\u062f\u0647 \u06a9\u0647 \u062f\u0631 \u0646\u0647\u0627\u06cc\u062a \u0645\u0648\u062c\u0628 \u0627\u0631\u062a\u0642\u0627\u0621 \u0633\u0637\u062d \u0631\u0636\u0627\u06cc\u062a\u0645\u0646\u062f\u06cc \u0648 \u062a\u0648\u0627\u0646\u0645\u0646\u062f \u0633\u0627\u0632\u06cc \u0645\u0631\u0627\u062c\u0639\u0647 \u06a9\u0646\u0646\u062f\u06af\u0627\u0646 \u0627\u0632 \u0637\u0631\u06cc\u0642 \u062a\u0633\u0647\u064a\u0644 \u0627\u0645\u06a9\u0627\u0646\u0627\u062a \u062f\u0633\u062a\u0631\u0633\u064a \u0627\u0632 \u0631\u0627\u0647 \u062f\u0648\u0631 \u0628\u0647 \u0645\u0646\u0627\u0628\u0639\u060c \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0639\u0644\u0645\u064a\u060c \u0627\u062e\u0628\u0627\u0631 \u0648... \u0628\u0627 \u0627\u0631\u0627\u0626\u0647 \u0631\u0648\u0632\u0622\u0645\u062f\u062a\u0631\u064a\u0646 \u0648 \u062f\u0642\u064a\u0642 \u062a\u0631\u064a\u0646 \u062e\u062f\u0645\u0627\u062a \u0648\u0641\u0646\u0627\u0648\u0631\u064a \u0647\u0627 \u0628\u0647 \u0645\u0631\u0627\u062c\u0639\u0627\u0646 \u062e\u0648\u0627\u0647\u062f \u06af\u0631\u062f\u064a\u062f.","yearPublished":"2019","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2019},{"_id":"61077d1ebee37141f4f136b6","authors":["Anthony J Comerota","Clive Kearon","Chu-Shu Gu","Jim A Julian","Samuel Z Goldhaber","Susan R Kahn","Michael R Jaff","Mahmood K Razavi","Andrei L Kindzelski","Riyaz Bashir","Parag Patel","Mel Sharafuddin","Michael J Sichlau","Wael E Saad","Zakaria Assi","Lawrence V Hofmann","Margaret Kennedy","Suresh Vedantham","ATTRACT Trial Investigators"],"title":"Endovascular thrombus removal for acute iliofemoral deep vein thrombosis: analysis from a stratified multicenter randomized trial","link":"https://www.ahajournals.org/doi/full/10.1161/CIRCULATIONAHA.118.037425","description":"Background:\\nThe ATTRACT trial (Acute Venous Thrombosis: Thrombus Removal with Adjunctive Catheter-Directed Thrombolysis) previously reported that pharmacomechanical catheter\u2013directed thrombolysis (PCDT) did not prevent postthrombotic syndrome (PTS) in patients with acute proximal deep vein thrombosis. In the current analysis, we examine the effect of PCDT in ATTRACT patients with iliofemoral deep vein thrombosis.\\nMethods:\\nWithin a large multicenter randomized trial, 391 patients with acute deep vein thrombosis involving the iliac or common femoral veins were randomized to PCDT with anticoagulation versus anticoagulation alone (No-PCDT) and were followed for 24 months to compare short-term and long-term outcomes.\\nResults:\\nBetween 6 and 24 months, there was no difference in the occurrence of PTS (Villalta scale \u22655 or ulcer: 49% PCDT versus 51% No-PCDT; risk ratio, 0.95; 95% CI, 0\xa0\u2026","yearPublished":"2019","citedBy":105,"category":{"type":"JOURNAL","categoryTitle":"Circulation","pages":"1162-1173","publisher":"Lippincott Williams & Wilkins","volume":"139","issue":"9"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2019},{"_id":"610f95618e338e5b6446da8f","authors":["Kais Hamza","FC Klebaner"],"title":"Expectation of local times and the Dupire formula","link":"https://www.monash.edu/__data/assets/pdf_file/0005/2019668/WP_CQFIS_2019_7.pdf","description":"In this paper, we give a sufficient condition under which the local martingale that appears in It\xf4\u2019s formula is a true martingale. As a consequence, we obtain a rigorous proof of the Dupire formula on local volatility.","yearPublished":"2019","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Stochastic Processes and their Applications","pages":"","publisher":"North-Holland","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da4f","authors":["Chunyang Chen","Sidong Feng","Zhenchang Xing","Linda Liu","Shengdong Zhao","Jinshui Wang"],"title":"Gallery D.C.: Design Search and Knowledge Discovery through Auto-created GUI Component Gallery","link":"https://nus-hci.org/wp-content/uploads/publications/2019/Chen%20et%20al.%20-%202019%20-%20Gallery%20D.C.%20Design%20Search%20and%20Knowledge%20Discover.pdf","description":"Online communities like Dribbble and GraphicBurger allow GUI designers to share their design artwork and learn from each other. These design sharing platforms are important sources for design inspiration, but our survey with GUI designers suggests additional information needs unmet by existing design sharing platforms. First, designers need to see the practical use of certain GUI designs in real applications, rather than just artworks. Second, designers want to see not only the overall designs but also the detailed design of the GUI components. Third, designers need advanced GUI design search abilities (e.g., multi-facets search) and knowledge discovery support (e.g., demographic investigation, cross-company design comparison). This paper presents Gallery D.C. http://mui-collection.herokuapp.com/, a gallery of GUI design components that harness GUI designs crawled from millions of real-world applications\xa0\u2026","yearPublished":"2019","citedBy":17,"category":{"type":"JOURNAL","categoryTitle":"Proceedings of the ACM on Human-Computer Interaction","pages":"180:1-180:22","publisher":"ACM","volume":"3","issue":"CSCW"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f93ad8e338e5b6446da4e","authors":["Sen Chen","Lingling Fan","Chunyang Chen","Minhui Xue","Yang Liu","Lihua Xu"],"title":"Gui-squatting attack: Automated generation of android phishing apps","link":"","description":"Mobile phishing attacks, such as mimic mobile browser pages, masquerade as legitimate applications by leveraging repackaging or clone techniques, have caused varied yet significant security concerns. Consequently, detection techniques have been receiving increasing attention. However, many such detection methods are not well tested and may therefore still be vulnerable to new types of phishing attacks. In this paper, we propose a new attacking technique, named GUI-Squatting attack, which can generate phishing apps (phapps) automatically and effectively. Our method adopts image processing and deep learning algorithms, to enable powerful and large-scale attacks. We observe that a successful phishing attack requires two conditions, page confusion and logic deception during attacks synthesis. We directly optimize these two conditions to create a practical attack. Our experimental results reveal that\xa0\u2026","yearPublished":"2019","citedBy":21,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Dependable and Secure Computing","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f95618e338e5b6446da94","authors":["Andrea Collevecchio","Kais Hamza","Yunxuan Liu"],"title":"Invariance principle for biased bootstrap random walks","link":"https://arxiv.org/pdf/1710.07920","description":"Our main goal is to study a class of processes whose increments are generated via a cellular automata rule. Given the increments of a simple biased random walk, a new sequence of (dependent) Bernoulli random variables is produced. It is built, from the original sequence, according to a cellular automata rule. Equipped with these two sequences, we construct two more according to the same cellular automata rule. The construction is repeated a fixed number of times yielding an infinite array ({\u2212 K,\u2026, K}\xd7 N) of (dependent) Bernoulli random variables. Taking partial sums of these sequences, we obtain a (2 K+ 1)-dimensional process whose increments belong to the state space {\u2212 1, 1} 2 K+ 1. The aim of the paper is to study the long term behaviour of this process. In particular, we establish transience/recurrence properties and prove an invariance principle. The limiting behaviour of these processes depends\xa0\u2026","yearPublished":"2019","citedBy":5,"category":{"type":"JOURNAL","categoryTitle":"Stochastic Processes and their Applications","pages":"860-877","publisher":"North-Holland","volume":"129","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"61077d1ebee37141f4f136b4","authors":["Clive Kearon","Sameer Parpia","Frederick A Spencer","Sam Schulman","Scott M Stevens","Vinay Shah","Kenneth A Bauer","James D Douketis","Steven R Lentz","Craig M Kessler","Jean M Connors","Jeffrey S Ginsberg","Luciana Spadafora","Jim A Julian"],"title":"Long\u2010term risk of recurrence in patients with a first unprovoked venous thromboembolism managed according to d\u2010dimer results; A cohort study","link":"https://onlinelibrary.wiley.com/doi/pdfdirect/10.1111/jth.14458","description":"Essentials Long\u2010term recurrence risk after a first unprovoked VTE with negative d\u2010dimer levels is uncertain. Anticoagulation was stopped if d\u2010dimer was negative, and was continued if d\u2010dimer was positive. Five years after stopping anticoagulants, recurrent VTE was 30% in men and 17% in women. Negative d\u2010dimers do not justify stopping anticoagulants in most men but appear to in most women. Background The long\u2010term risk of recurrence in patients with a first unprovoked venous thromboembolism (VTE) who have negative d\u2010dimer results is uncertain. Objectives To determine this risk, including in subgroups based on sex. Patients and methods ln a prospective interventional cohort study of 410 patients with a first unprovoked VTE, anticoagulants were stopped if d\u2010dimer was negative on therapy and 1 month after stopping therapy. Other patients remained on anticoagulant therapy. We previously reported\xa0\u2026","yearPublished":"2019","citedBy":21,"category":{"type":"JOURNAL","categoryTitle":"Journal of Thrombosis and Haemostasis","pages":"1144-1152","publisher":"","volume":"17","issue":"7"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:34.999Z","updatedAt":"2021-08-02T05:05:34.999Z","year":2019},{"_id":"610f95618e338e5b6446da91","authors":["Martin Ian MacDonald","Christian R Osadnik","Lauren Bulfin","Kais Hamza","Paul Leong","Anders Wong","Paul T King","Philip G Bardin"],"title":"Low and high blood eosinophil counts as biomarkers in hospitalized acute exacerbations of COPD","link":"","description":"Background\\nCharacterizing acute exacerbations of COPD (AECOPD) and individualizing therapy is challenging. Key exacerbation therapies include antibiotics and systemic corticosteroids. Blood eosinophils, when either low or high, may offer a simple, inexpensive distinction to predict beneficial responses to these therapies.\\nMethods\\nWe conducted derivation (n = 242) and validation (n = 99) cohort studies of patients hospitalized for AECOPD. Patients who received oral corticosteroids before ED presentation were excluded. The derivation cohort was identified by individual case file review. The validation cohort was prospectively recruited during hospital admission. Exacerbations were grouped according to blood eosinophil count as low (<50/\u03bcL), normal (50-150/\u03bcL), or high (>150/\u03bcL). Exacerbations were classified as being associated with infection if either virus testing was positive or C-reactive protein was \u226520\xa0\u2026","yearPublished":"2019","citedBy":31,"category":{"type":"JOURNAL","categoryTitle":"Chest","pages":"92-100","publisher":"Elsevier","volume":"156","issue":"1"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f95618e338e5b6446da8c","authors":["Robert Griffiths","Kais Hamza"],"title":"Matching marginals and sums","link":"https://arxiv.org/pdf/1911.07209","description":"For a given set of random variables  we seek as large a family as possible of random variables  such that the marginal laws and the laws of the sums match:  and . Under the assumption that  are independent and belong to any of the Meixner classes, we give a full characterisation of the random variables  and propose a practical construction by means of a finite mean square expansion. When  are identically distributed but not necessarily independent, using a symmetry-balancing approach we provide a universal construction with sufficient symmetry to satisfy the more stringent requirement that, for any symmetric function , .","yearPublished":"2019","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1911.07209","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da54","authors":["Chunyang Chen","Zhenchang Xing","Yang Liu","Kent Long Xiong Ong"],"title":"Mining likely analogical apis across third-party libraries via large-scale unsupervised api semantics embedding","link":"","description":"Establishing API mappings between third-party libraries is a prerequisite step for library migration tasks. Manually establishing API mappings is tedious due to the large number of APIs to be examined. Having an automatic technique to create a database of likely API mappings can significantly ease the task. Unfortunately, existing techniques either adopt supervised learning mechanism that requires already-ported or functionality similar applications across major programming languages or platforms, which are difficult to come by for an arbitrary pair of third-party libraries, or cannot deal with lexical gap in the API descriptions of different libraries. To overcome these limitations, we present an unsupervised deep learning based approach to embed both API usage semantics and API description (name and document) semantics into vector space for inferring likely analogical API mappings between libraries. Based on\xa0\u2026","yearPublished":"2019","citedBy":32,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Software Engineering","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f95618e338e5b6446da90","authors":["Malcolm Baxter","Laurence Ruane","Debra Phyland","Elizabeth Leahy","Emily Heke","Kenneth K Lau","Kathy Low","Kais Hamza","Martin MacDonald","Philip G Bardin"],"title":"Multidisciplinary team clinic for vocal cord dysfunction directs therapy and significantly reduces healthcare utilization","link":"https://onlinelibrary.wiley.com/doi/pdfdirect/10.1111/resp.13520","description":"Background and objective\\nMultidisciplinary team (MDT) clinics use an integrated approach to individualize care of complex medical conditions. Vocal cord dysfunction (VCD) is a challenging condition that is likely to benefit from MDT clinics but this has not been researched.\\nMethods\\nA prospective observational cohort study of a novel VCD MDT clinic was conducted in patients with suspected VCD. Relevant questionnaires, medical history, physical examination, spirometry, dynamic computerized tomography (CT) larynx and laryngoscopy were utilized and patients were allocated to treatment pathways depending on putative diagnosis. Speech pathology intervention with laryngeal retraining (LR) was offered and if LR therapy failed botulinum toxin injection was offered. Primary outcome was reductions in healthcare utilization.\\nResults\\nOverall, 80 consecutive patients were included in analyses. A definitive\xa0\u2026","yearPublished":"2019","citedBy":9,"category":{"type":"JOURNAL","categoryTitle":"Respirology","pages":"758-764","publisher":"John Wiley & Sons, Ltd","volume":"24","issue":"8"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"61077d1ebee37141f4f136b8","authors":["J Connors","S Parpia","F Spencer","S Schulman","S Stevens","Vinay Shah","K Bauer","J Douketis","L Stephen","C Kessler","J Ginsburg","L Spadafora","J Julian","C Kearon"],"title":"Negative D-dimer Not Sufficient to Stop Anticoagulation in Men","link":"","description":"Background:\\nPatients with unprovoked VTE have high recurrence risk if anticoagulation is stopped after initial treatment. How to determine the need for long-term anticoagulation is unclear. D-dimer results have been proposed as a risk stratification tool, with low values suggesting lower risk of recurrence.\\nAims:\\nTo evaluate risk of recurrent VTE in patients with first unprovoked proximal DVT or PE and negative D-dimer test on anticoagulants and 1 month after stopping.\\nMethods:\\nAfter 3 to 7 months of anticoagulation, 410 patients had D-dimer levels on and at 1 month off anticoagulation. If both were negative patients remained off anticoagulation and were followed for median of 5.0 years; longest duration of follow up 7.5 years. Primary outcome was symptomatic recurrent VTE. We describe time to first recurrent VTE, the overall rate of recurrent VTE, and assessed changes in recurrence rates over time.\\nResults:\\nIn 319 patients remaining off anticoagulants, recurrent VTE was 5.1%(60/319) per patient-year (95% CI 3.6 to 6.5); 7.5% per patient-year (95% CI 5.5 to 10.0) in men, 3.8% per patient-year (95% CI 2.0 to 6.6) in women with VTE not associated with estrogens, and 0.4% per patient-year (95% CI 0.0 to 2.3) in women with estrogen associated VTE (p< 0.001 for 3-group comparison). The cumulative risk of recurrence at 5 years was 21.5%(95% CI 16.4 to 26.5) overall, 29.7%(95% CI 22.1 to 37.3) for men, 17.0%(95% CI 8.1 to 25.9) for non-estrogen women, and 2.3%(95% CI 0.0 to 6.8) for estrogenwomen. Annualized rate of recurrent VTE in non-anticoagulated patients was 7.8% in year 1, 7.5% in year 2, 2.9% in year 3, 3.8% in year 4, 2.1% in year\xa0\u2026","yearPublished":"2019","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"209","publisher":"","volume":"3","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2019},{"_id":"610f93ad8e338e5b6446da56","authors":["Xiang Chen","Chunyang Chen","Zhang Dun","Zhenchang Xing"],"title":"SEthesaurus: WordNet in Software Engineering","link":"","description":"Informal discussions on social platforms (e.g., Stack Overflow, CodeProject) have accumulated a large body of programming knowledge in the form of natural language text. Natural language process (NLP) techniques can be utilized to harvest this knowledge base for software engineering tasks. However, consistent vocabulary for a concept is essential to make an effective use of these NLP techniques. Unfortunately, the same concepts are often intentionally or accidentally mentioned in many different morphological forms (such as abbreviations, synonyms and misspellings) in informal discussions. Existing techniques to deal with such morphological forms are either designed for general English or mainly resort to domain-specific lexical rules. A thesaurus, which contains software-specific terms and commonly-used morphological forms, is desirable to perform normalization for software engineering text. However\xa0\u2026","yearPublished":"2019","citedBy":10,"category":{"type":"JOURNAL","categoryTitle":"IEEE Transactions on Software Engineering","pages":"","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f95618e338e5b6446da92","authors":["Rongju Zhang","Nicolas Langren\xe9","Yu Tian","Zili Zhu","Fima Klebaner","Kais Hamza"],"title":"Skewed target range strategy for multiperiod portfolio optimization using a two-stage least squares Monte Carlo method","link":"https://arxiv.org/pdf/1704.00416","description":"In this paper, we propose a novel investment strategy for portfolio optimization problems. The proposed strategy maximizes the expected portfolio value bounded within a targeted range, composed of a conservative lower target representing a need for capital protection and a desired upper target representing an investment goal. This strategy favorably shapes the entire probability distribution of returns, as it simultaneously seeks a desired expected return, cuts off downside risk and implicitly caps volatility and higher moments. To illustrate the effectiveness of this investment strategy, we study a multiperiod portfolio optimization problem with transaction costs and develop a two-stage regression approach that improves the classical least squares Monte Carlo (LSMC) algorithm when dealing with difficult payoffs, such as highly concave, abruptly changing or discontinuous functions. Our numerical results show substantial improvements over the classical LSMC algorithm for both the constant relative risk-aversion (CRRA) utility approach and the proposed skewed target range strategy (STRS). Our numerical results illustrate the ability of the STRS to contain the portfolio value within the targeted range. When compared with the CRRA utility approach, the STRS achieves a similar mean\u2013variance efficient frontier while delivering a better downside risk\u2013return trade-off.","yearPublished":"2019","citedBy":5,"category":{"type":"JOURNAL","categoryTitle":"Journal of Computational Finance, Forthcoming","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da52","authors":["Sen Chen","Lingling Fan","Chunyang Chen","Ting Su","Wenhe Li","Yang Liu","Lihua Xu"],"title":"Storydroid: Automated generation of storyboard for Android apps","link":"https://arxiv.org/pdf/1902.00476","description":"Mobile apps are now ubiquitous. Before developing a new app, the development team usually endeavors painstaking efforts to review many existing apps with similar purposes. The review process is crucial in the sense that it reduces market risks and provides inspiration for app development. However, manual exploration of hundreds of existing apps by different roles (e.g., product manager, UI/UX designer, developer) in a development team can be ineffective. For example, it is difficult to completely explore all the functionalities of the app in a short period of time. Inspired by the conception of storyboard in movie production, we propose a system, StoryDroid, to automatically generate the storyboard for Android apps, and assist different roles to review apps efficiently. Specifically, StoryDroid extracts the activity transition graph and leverages static analysis techniques to render UI pages to visualize the storyboard\xa0\u2026","yearPublished":"2019","citedBy":30,"category":{"type":"CONFERENCE","categoryTitle":"2019 IEEE/ACM 41st International Conference on Software Engineering (ICSE)","pages":"596-607","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f93ad8e338e5b6446da55","authors":["Simon Colton","Alison Pease","Michael Cook","Chunyang Chen"],"title":"The HR3 system for automated code generation in creative settings","link":"https://research.monash.edu/files/324969135/324817276_oa.pdf","description":"We describe the HR3 system for automated code generation, and its use in creative tasks. We outline the motivations and overall ideology behind its construction, most notably by identifying some distinctions in AI methodology which can be ignored when AI tasks are viewed as code generation problems to be solved. We further describe the nature of the approach in terms of: a programmatic interface to a Java API; production rule-based batch processing of data; on-demand code generation and inspection, and the usage of randomised and meta-level codebases. To support the claim that the approach is general purpose, we describe five applications in three areas normally covered by separate Computational Creativity systems, namely mathematical discovery, datamining and generative art. We end by discussing future directions for the HR3 system and how this project might address some higher-level issues in Computational Creativity.","yearPublished":"2019","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"Proceedings of the 10th ICCC","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"610f95618e338e5b6446da8e","authors":["Christopher P Daley","Laurence E Ruane","Paul Leong","Kenneth K Lau","Kathy Low","Kais Hamza","Paul Finlay","Martin MacDonald","Malcolm Baxter","Philip G Bardin"],"title":"Vocal Cord Dysfunction in Patients Hospitalized with Symptoms of Acute Asthma Exacerbation","link":"https://www.atsjournals.org/doi/full/10.1164/rccm.201902-0396LE","description":"Vocal cord dysfunction (VCD), also called inducible laryngeal obstruction, is characterized by inspiratory closure of the vocal cords associated with paradoxical vocal cord movement. During expiration, closure of the vocal cords is a normal phenomenon precluding a reliable diagnosis of VCD (1). Diagnosis is made by laryngoscopy upon detection of paradoxical vocal cord movement and a diamond-shaped \u201cchink\u201d during inspiration (2). VCD was initially considered exclusively as a mimic of asthma, but subsequent studies suggested that it frequently coexists with asthma. Newman and coworkers detected VCD in more than 50% of subjects with severe asthma (3), and in a previous study we detected VCD in approximately 35% of patients with severe symptomatic asthma and almost 20% of patients with milder disease (4).\\nTo date, studies of VCD have been conducted almost exclusively in subjects with stable asthma\xa0\u2026","yearPublished":"2019","citedBy":4,"category":{"type":"JOURNAL","categoryTitle":"American journal of respiratory and critical care medicine","pages":"782-785","publisher":"American Thoracic Society","volume":"200","issue":"6"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f95618e338e5b6446da8d","authors":["Laurence Ruane","Chris Daley","Danile D\u2019Souza","Paul Leong","Kathy Low","Kenneth Lau","Kais Hamza","Martin Macdonald","Malcolm Baxter","Philip Bardin"],"title":"Vocal cord dysfunction (VCD) in hospitalised exacerbations of asthma and chronic obstructive pulmonary disease (COPD)","link":"","description":"Introduction: Vocal cord dysfunction (VCD) causes vocal cord narrowing during inspiration resulting in airflow obstruction and breathlessness. In asthma VCD can be found in up to 20% of stable asthmatics but few studies have examined coexisting VCD in exacerbated asthma and none in COPD. We hypothesised that VCD may occur frequently during acute asthma and COPD exacerbations.\\nMethod: Overall 34 patients with asthma exacerbations and 37 patients with exacerbations of COPD were studied in the emergency department (ED). All patients had a previous diagnosis of asthma or COPD confirmed by lung function. Asthma chronic disease severity was based on GINA and exacerbation severity based on a validated score. COPD chronic disease severity was based on GOLD criteria and exacerbation severity was based on BAP-65. Dynamic computerised tomography (CT) imaging was done as soon as\xa0\u2026","yearPublished":"2019","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"European Respiratory Society","volume":"54","issue":"suppl 63"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2019},{"_id":"610f93ad8e338e5b6446da51","authors":["Chunyang Chen","Zhenchang Xing","Yang Liu"],"title":"What\u2019s spain\u2019s paris? mining analogical libraries from q&a discussions","link":"","description":"Third-party libraries are an integral part of many software projects. It often happens that developers need to find analogical libraries that can provide comparable features to the libraries they are already familiar with for different programming languages or different mobile platforms. Existing methods to find analogical libraries are limited by the community-curated list of libraries, blogs, or Q&A posts, which often contain overwhelming or out-of-date information. In this paper, we present a new approach to recommend analogical libraries based on a knowledge base of analogical libraries mined from tags of millions of Stack Overflow questions. The novelty of our approach is to solve analogical-library questions by combining state-of-the-art word embedding technique and domain-specific relational and categorical knowledge mined from Stack Overflow. Given a library and a recommended analogical library, our\xa0\u2026","yearPublished":"2019","citedBy":15,"category":{"type":"JOURNAL","categoryTitle":"Empirical Software Engineering","pages":"1155-1194","publisher":"Springer US","volume":"24","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.604Z","updatedAt":"2021-08-08T08:19:57.604Z","year":2019},{"_id":"6106d5e3e9f6c65d2cf52b67","authors":["gnwgnwyrfgafh"],"title":"safbsfgnwyr","yearPublished":"2019","description":"agfnwgnwygn","link":"","category":{"type":"JOURNAL","categoryTitle":"sghnsfgn","volume":"","issue":"","pages":"","publisher":""},"teamId":"6105283db9496004d4f0b74b","createdAt":"2021-08-01T17:12:03.160Z","updatedAt":"2021-08-01T17:12:03.160Z","__v":0,"year":2019},{"_id":"61077d1ebee37141f4f136bb","authors":["Lili Aslostovar","Allison L Boyd","Mohammed Almakadi","Tony J Collins","Darryl P Leong","Rommel G Tirona","Richard B Kim","Jim A Julian","Anargyros Xenocostas","Brian Leber","Mark N Levine","Ronan Foley","Mickie Bhatia"],"title":"A phase 1 trial evaluating thioridazine in combination with cytarabine in patients with acute myeloid leukemia","link":"https://ashpublications.org/bloodadvances/article/2/15/1935/15949","description":"We completed a phase 1 dose-escalation trial to evaluate the safety of a dopamine receptor D2 (DRD2) antagonist thioridazine (TDZ), in combination with cytarabine. Thirteen patients 55 years and older with relapsed or refractory acute myeloid leukemia (AML) were enrolled. Oral TDZ was administered at 3 dose levels: 25 mg (n = 6), 50 mg (n = 4), or 100 mg (n = 3) every 6 hours for 21 days. Intermediate-dose cytarabine was administered on days 6 to 10. Dose-limiting toxicities (DLTs) included grade 3 QTc interval prolongation in 1 patient at 25 mg TDZ and neurological events in 2 patients at 100 mg TDZ (gait disturbance, depressed consciousness, and dizziness). At the 50-mg TDZ dose, the sum of circulating DRD2 antagonist levels approached a concentration of 10 \u03bcM, a level noted to be selectively active against human AML in vitro. Eleven of 13 patients completed a 5-day lead-in with TDZ, of which 6\xa0\u2026","yearPublished":"2018","citedBy":20,"category":{"type":"JOURNAL","categoryTitle":"Blood advances","pages":"1935-1945","publisher":"American Society of Hematology","volume":"2","issue":"15"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2018},{"_id":"61077d1ebee37141f4f136bd","authors":["Clive Kearon","Sameer Parpia","Frederick A Spencer","Trevor Baglin","Scott M Stevens","Kenneth A Bauer","Steven R Lentz","Craig M Kessler","James D Douketis","Stephan Moll","Scott Kaatz","Sam Schulman","Jean M Connors","Jeffrey S Ginsberg","Luciana Spadafora","Vinai Bhagirath","Patricia C Liaw","Jeffrey I Weitz","Jim A Julian"],"title":"Antiphospholipid antibodies and recurrent thrombosis after a first unprovoked venous thromboembolism","link":"https://www.sciencedirect.com/science/article/pii/S0006497120322485","description":"It is uncertain whether antiphospholipid antibodies (APAs) increase the risk of recurrence after a first unprovoked venous thromboembolism (VTE). We tested for anticardiolipin antibodies, anti\u2013\u03b22 glycoprotein 1 antibodies, and lupus anticoagulant on 2 occasions \u223c6 months apart in 307 patients with a first unprovoked VTE who were part of a prospective cohort study. We then determined if APAs were associated with recurrent thrombosis in the 290 patients who stopped anticoagulant therapy in response to negative D-dimer results. Compared with those without an APA, the hazard ratios for recurrent VTE were 1.8 (95% confidence interval [CI], 0.9-3.7; P = .09) in the 25.9% of patients with an APA on \u22651 occasions, 2.7 (95% CI, 1.1-.7; P = .03) in the 9.0% of patients with the same APA on 2 occasions, and 4.5 (95% CI, 1.5-13.0; P = .006) in the 3.8% of patients with 2 or 3 different APA types on either the same or\xa0\u2026","yearPublished":"2018","citedBy":41,"category":{"type":"JOURNAL","categoryTitle":"Blood, The Journal of the American Society of Hematology","pages":"2151-2160","publisher":"American Society of Hematology","volume":"131","issue":"19"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2018},{"_id":"610f93ad8e338e5b6446da5c","authors":["Chunyang Chen","Xi Chen","Jiamou Sun","Zhenchang Xing","Guoqiang Li"],"title":"Data-driven proactive policy assurance of post quality in community q&a sites","link":"https://www.researchgate.net/profile/Guoqiang-Li-22/publication/328681390_Data-Driven_Proactive_Policy_Assurance_of_Post_Quality_in_Community_qa_Sites/links/5f7f06e2458515b7cf6f6600/Data-Driven-Proactive-Policy-Assurance-of-Post-Quality-in-Community-q-a-Sites.pdf","description":"To ensure the post quality, Q&A sites usually develop a list of quality assurance guidelines for \\"dos and don\'ts\\", and adopt collaborative editing mechanism to fix quality violations. Quality guidelines are mostly high-level principles, and many tacit and context-sensitive aspects of the expected quality cannot be easily enforced by a set of explicit rules. Collaborative editing is a reactive mechanism after low-quality posts have been posted. Our study of collaborative editing data on Stack Overflow suggests that tacit and context-sensitive quality-assurance knowledge is manifested in the editing patterns of large numbers of collaborative edits. Inspired by this observation, we develop and evaluate a Convolutional Neural Network based approach to learn editing patterns from historical post edits for predicting the need of editing a post. Our approach provides a proactive policy assurance mechanism that warns users\xa0\u2026","yearPublished":"2018","citedBy":21,"category":{"type":"JOURNAL","categoryTitle":"Proceedings of the ACM on Human-Computer Interaction","pages":"1-22","publisher":"ACM","volume":"2","issue":"CSCW"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2018},{"_id":"610f93ad8e338e5b6446da59","authors":["Lei Ma","Felix Juefei-Xu","Fuyuan Zhang","Jiyuan Sun","Minhui Xue","Bo Li","Chunyang Chen","Ting Su","Li Li","Yang Liu","Jianjun Zhao","Yadong Wang"],"title":"Deepgauge: Multi-granularity testing criteria for deep learning systems","link":"https://arxiv.org/pdf/1803.07519","description":"Deep learning (DL) defines a new data-driven programming paradigm that constructs the internal system logic of a crafted neuron network through a set of training data. We have seen wide adoption of DL in many safety-critical scenarios. However, a plethora of studies have shown that the state-of-the-art DL systems suffer from various vulnerabilities which can lead to severe consequences when applied to real-world applications. Currently, the testing adequacy of a DL system is usually measured by the accuracy of test data. Considering the limitation of accessible high quality test data, good accuracy performance on test data can hardly provide confidence to the testing adequacy and generality of DL systems. Unlike traditional software systems that have clear and controllable logic and functionality, the lack of interpretability in a DL system makes system analysis and defect detection difficult, which could\xa0\u2026","yearPublished":"2018","citedBy":298,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 33rd ACM/IEEE International Conference on Automated Software Engineering","pages":"120-131","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2018},{"_id":"610f93ad8e338e5b6446da5b","authors":["Chunyang Chen"],"title":"Distilling crowd knowledge from software-specific Q&A discussions for assisting developers\u2019 knowledge search","link":"https://www.researchgate.net/profile/Chunyang-Chen-2/publication/336889952_Distilling_crowd_knowledge_from_software-specific_QA_discussions_for_assisting_developers\'_knowledge_search/links/5db908eb92851c818014a56f/Distilling-crowd-knowledge-from-software-specific-Q-A-discussions-for-assisting-developers-knowledge-search.pdf","description":"With software penetrating all kinds of traditional or emerging industries, and rapid development of information technology, there is a great demand on software development. In addition, as the task gets more and more complicated, the corresponding software also becomes more and more complex 1. For example, some software are implemented with millions of lines of source code such as Windows 2, Jet control system 3. However, due to the limited number of developers, there is an urgent need to boost developers\u2019 productivity.\\nDuring the evolution of software engineering, a lot of software development experience has been recorded in different software repositories such as code in GitHub, Q&A discussions in Stack Overflow, bug reports in Bugzilla, software vulnerabilities in CVE database, etc. These heterogeneous repositories created by millions of developers serve as the big data of software engineering practices. Reusing the experience in the big data can help avoid re-implementing the wheels, which improves developers\u2019 productivity.","yearPublished":"2018","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2018},{"_id":"610f95618e338e5b6446da99","authors":["Natalie Law","Laurence E Ruane","Kathy Low","Kais Hamza","Philip G Bardin"],"title":"Dysfunctional breathing is more frequent in chronic obstructive pulmonary disease than in asthma and in health","link":"https://www.researchgate.net/profile/Laurence-Ruane-2/publication/319507905_Dysfunctional_breathing_is_more_frequent_in_chronic_obstructive_pulmonary_disease_than_in_asthma_and_in_health/links/5c11f2db92851c39ebe92f14/Dysfunctional-breathing-is-more-frequent-in-chronic-obstructive-pulmonary-disease-than-in-asthma-and-in-health.pdf","description":"Involuntary adaptations of breathing patterns to counter breathlessness may lead to dysfunctional breathing in obstructive lung diseases. However, no studies examining dysfunctional breathing in Chronic Obstructive Pulmonary Disease (COPD) have been reported.\\nPatients with verified COPD (n\xa0=\xa034), asthma (n\xa0=\xa037) and a healthy control group (n\xa0=\xa041) were recruited. All participants completed the Nijmegen questionnaire for dysfunctional breathing as well as measures of disease activity. Comparisons between groups employed analysis of variance with post-hoc Bonferroni analyses and Pearson correlation for associations.\\nPatients with COPD had significantly higher Nijmegen questionnaire scores than asthmatics (COPD: 23.4\xa0\xb1\xa010.6 versus 17.3\xa0\xb1\xa010.6, p\xa0=\xa00.016) and healthy individuals (14.3\xa0\xb1\xa09.6, p\xa0=\xa00.002). Significantly more patients with COPD had severe dysfunctional breathing with Nijmegen scores >23\xa0\u2026","yearPublished":"2018","citedBy":16,"category":{"type":"JOURNAL","categoryTitle":"Respiratory physiology & neurobiology","pages":"20-23","publisher":"Elsevier","volume":"247","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2018},{"_id":"610f93ad8e338e5b6446da5a","authors":["Chunyang Chen","Ting Su","Guozhu Meng","Zhenchang Xing","Yang Liu"],"title":"From ui design image to gui skeleton: a neural machine translator to bootstrap mobile gui implementation","link":"http://acm.mementodepot.org/pubs/proceedings/acmconferences_3180155/3180155/3180155.3180240/3180155.3180240.pdf","description":"A GUI skeleton is the starting point for implementing a UI design image. To obtain a GUI skeleton from a UI design image, developers have to visually understand UI elements and their spatial layout in the image, and then translate this understanding into proper GUI components and their compositions. Automating this visual understanding and translation would be beneficial for bootstraping mobile GUI implementation, but it is a challenging task due to the diversity of UI designs and the complexity of GUI skeletons to generate. Existing tools are rigid as they depend on heuristically-designed visual understanding and GUI generation rules. In this paper, we present a neural machine translator that combines recent advances in computer vision and machine translation for translating a UI design image into a GUI skeleton. Our translator learns to extract visual features in UI images, encode these features\' spatial layouts\xa0\u2026","yearPublished":"2018","citedBy":80,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 40th International Conference on Software Engineering","pages":"665-676","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2018},{"_id":"610f95618e338e5b6446da98","authors":["Rongju Zhang","Nicolas Langren\xe9","Yu Tian","Zili Zhu","Fima Klebaner","Kais Hamza"],"title":"Local control regression: Improving the least squares Monte Carlo method for portfolio optimization","link":"https://arxiv.org/pdf/1803.11467","description":"The least squares Monte Carlo algorithm has become popular for solving portfolio optimization problems. A simple approach is to approximate the value functions on a discrete grid of portfolio weights, then use control regression to generalize the discrete estimates. However, the classical global control regression can be expensive and inaccurate. To overcome this difficulty, we introduce a local control regression technique, combined with adaptive grids. We show that choosing a coarse grid for local regression can produce sufficiently accurate results.","yearPublished":"2018","citedBy":4,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1803.11467","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2018},{"_id":"610f95618e338e5b6446da97","authors":["Jeremy Baker","P Chigansky","K Hamza","FC Klebaner"],"title":"Persistence of small noise and random initial conditions","link":"https://arxiv.org/pdf/1802.06231","description":"The effect of small noise in a smooth dynamical system is negligible on any finite time interval; in this paper we study situations where the effect persists on intervals increasing to \u221e. Such an asymptotic regime occurs when the system starts from an initial condition that is sufficiently close to an unstable fixed point. In this case, under appropriate scaling, the trajectory converges to a solution of the unperturbed system started from a certain random initial condition. In this paper we consider the case of one-dimensional diffusions on the positive half-line; this case often arises as a scaling limit in population dynamics.","yearPublished":"2018","citedBy":3,"category":{"type":"JOURNAL","categoryTitle":"Advances in Applied Probability","pages":"67-81","publisher":"Cambridge University Press","volume":"50","issue":"A"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2018},{"_id":"61077d1ebee37141f4f136be","authors":["Nicole Mittmann","Craig C Earle","Stephanie Y Cheng","Jim A Julian","Farah Rahman","Soo Jin Seung","Mark N Levine"],"title":"Population-based study to determine the health system costs of using the 21-gene assay","link":"https://clf1.medpagetoday.com/content/pdf/reading-room/asco/JCO.BR.Mittmann2017124134542184.pdf","description":"Purpose\\nThe 21-gene assay Oncotype Dx (Genomic Health, Redwood City, CA) test is used to aid the decision about chemotherapy in patients with hormone receptor\u2013positive breast cancer who received endocrine therapy. Economic studies to support test adoption used decision-analytic models with assumptions and data derived from disparate sources. The objective was to evaluate whether the 21-gene assay test resulted in an overall cost expense or saving to the health system.","yearPublished":"2018","citedBy":20,"category":{"type":"JOURNAL","categoryTitle":"J Clin Oncol","pages":"238-243","publisher":"","volume":"36","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2018},{"_id":"61077d1ebee37141f4f136bc","authors":["S Takach Lapner","Jim A Julian","L\u2010A Linkins","SM Bates","Clive Kearon"],"title":"Questioning the use of an age\u2010adjusted D\u2010dimer threshold to exclude venous thromboembolism: reply","link":"https://onlinelibrary.wiley.com/doi/pdfdirect/10.1111/jth.14155","description":"In a recent analysis [1] we questioned the validity of using a progressively higher D-dimer to define a positive test as the age of patients with suspected venous thromboembolism (VTE) increased over 50years (termed \u2018ageadjusted D-dimer\u2019interpretation). We hypothesized that the benefits of age-adjusted D-dimer interpretation compared with using a conventional threshold of 500 ug L\xe01 in patients of all ages were due to a non-specific increase in the average D-dimer threshold used to classify a test as positive. We tested this hypothesis by comparing ageadjusted D-dimer interpretation with two very different ways of interpreting D-dimer values in relationship to age. The first alternative was to use the same D-dimer level in all patients (termed \u2018mean D-dimer\u2019interpretation). The second alternative was to use a progressively higher D-dimer threshold as age decreased below 66 years (termed \u2018inverse age-adjusted\u2019D\xa0\u2026","yearPublished":"2018","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Journal of Thrombosis and Haemostasis","pages":"1448-1450","publisher":"","volume":"16","issue":"7"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2018},{"_id":"610f93ad8e338e5b6446da58","authors":["Yi Huang","Chunyang Chen","Zhenchang Xing","Tian Lin","Yang Liu"],"title":"Tell them apart: distilling technology differences from crowd-scale comparison discussions","link":"https://www.researchgate.net/profile/Chunyang-Chen-2/publication/327131742_Tell_them_apart_distilling_technology_differences_from_crowd-scale_comparison_discussions/links/5b9f514e299bf13e6037ce25/Tell-them-apart-distilling-technology-differences-from-crowd-scale-comparison-discussions.pdf","description":"Developers can use different technologies for many software development tasks in their work. However, when faced with several technologies with comparable functionalities, it is not easy for developers to select the most appropriate one, as comparisons among technologies are time-consuming by trial and error. Instead, developers can resort to expert articles, read official documents or ask questions in Q&A sites for technology comparison, but it is opportunistic to get a comprehensive comparison as online information is often fragmented or contradictory. To overcome these limitations, we propose the diffTech system that exploits the crowdsourced discussions from Stack Overflow, and assists technology comparison with an informative summary of different comparison aspects. We first build a large database of comparable software technologies by mining tags in Stack Overflow, and locate comparative sentences\xa0\u2026","yearPublished":"2018","citedBy":17,"category":{"type":"CONFERENCE","categoryTitle":"2018 33rd IEEE/ACM International Conference on Automated Software Engineering (ASE)","pages":"214-224","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2018},{"_id":"610f95618e338e5b6446da9b","authors":["K Low","L Ruane","N Uddin","P Finlay","KK Lau","K Hamza","PW Holmes","G Hamilton","PG Bardin"],"title":"Abnormal vocal cord movement in patients with and without airway obstruction and asthma symptoms","link":"","description":"Background\\nAbnormal vocal cord movements can cause laryngeal extrathoracic airway obstruction (often called vocal cord dysfunction \u2013 VCD) leading to asthma\u2010like symptoms. These aberrant movements are characteristically present during inspiration and termed paradoxical vocal cord movement (PVCM). We have reported PVCM in up to 40% of severe asthmatics, but it is not known if PVCM is detectable in all patients with asthma\u2010like symptoms and if the condition is more often associated with abnormal lung function.\\nObjective\\nWe hypothesized that PVCM is frequently associated with asthma symptoms accompanied by airflow limitation. Studies examined whether PVCM is solely linked to experiencing asthma symptoms, or if PVCM is related to airflow limitation and/or other disease characteristics.\\nMethods\\nPatients with asthma symptoms were recruited from general practice and severe asthma clinics (n\xa0\u2026","yearPublished":"2017","citedBy":27,"category":{"type":"JOURNAL","categoryTitle":"Clinical & Experimental Allergy","pages":"200-207","publisher":"","volume":"47","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2017},{"_id":"610f93ad8e338e5b6446da5d","authors":["Chunyang Chen","Zhenchang Xing","Yang Liu"],"title":"By the Community & For the Community: A Deep Learning Approach to Assist Collaborative Editing in Q&A Sites","link":"","description":"Community edits to questions and answers (called post edits) plays an important role in improving content quality in Stack Overflow. Our study of post edits in Stack Overflow shows that a large number of edits are about formatting, grammar and spelling. These post edits usually involve small-scale sentence edits and our survey of trusted contributors suggests that most of them care much or very much about such small sentence edits. To assist users in making small sentence edits, we develop an edit-assistance tool for identifying minor textual issues in posts and recommending sentence edits for correction. We formulate the sentence editing task as a machine translation problem, in which an original sentence is \\"translated\\" into an edited sentence. Our tool implements a character-level Recurrent Neural Network (RNN) encoder-decoder model, trained with about 6.8 millions original-edited sentence pairs from Stack\xa0\u2026","yearPublished":"2017","citedBy":31,"category":{"type":"JOURNAL","categoryTitle":"Proceedings of the ACM on Human-Computer Interaction","pages":"21","publisher":"ACM","volume":"1","issue":"CSCW"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2017},{"_id":"61077d1ebee37141f4f136c3","authors":["Anand Swaminath","Marcin Wierzbicki","Sameer Parpia","James R Wright","Theodoros K Tsakiridis","Gordon S Okawara","Vijayananda Kundapur","Alexis Bujold","Naseer Ahmed","Khalid Hirmiz","Elizabeth Kurien","Edith Filion","Zsolt Gabos","Sergio Faria","Alexander V Louie","Timothy Owen","Elaine Wai","Kevin Ramchandar","Elisa K Chan","Jim Julian","Kathryn Cline","Timothy J Whelan"],"title":"Canadian phase III randomized trial of stereotactic body radiotherapy versus conventionally hypofractionated radiotherapy for stage I, medically inoperable non\u2013small-cell lung\xa0\u2026","link":"","description":"We describe a Canadian phase III randomized controlled trial of stereotactic body radiotherapy (SBRT) versus conventionally hypofractionated radiotherapy (CRT) for the treatment of stage I medically inoperable non\u2013small-cell lung cancer (OCOG-LUSTRE Trial).\\nEligible patients are randomized in a 2:1 fashion to either SBRT (48 Gy in 4 fractions for peripherally located lesions; 60 Gy in 8 fractions for centrally located lesions) or CRT (60 Gy in 15 fractions). The primary outcome of the study is 3-year local control, which we hypothesize will improve from 75% with CRT to 87.5% with SBRT. With 85% power to detect a difference of this magnitude (hazard ratio\xa0= 0.46), a 2-sided \u03b1\xa0= 0.05 and a 2:1 randomization, we require a sample size of 324 patients (216 SBRT, 108 CRT). Important secondary outcomes include overall survival, disease-free survival, toxicity, radiation-related treatment death, quality of life, and cost\xa0\u2026","yearPublished":"2017","citedBy":26,"category":{"type":"JOURNAL","categoryTitle":"Clinical lung cancer","pages":"250-254","publisher":"Elsevier","volume":"18","issue":"2"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.001Z","updatedAt":"2021-08-02T05:05:35.001Z","year":2017},{"_id":"61077d1ebee37141f4f136c0","authors":["Sarah Takach Lapner","Jim A Julian","Lori-Ann Linkins","Shannon M Bates","Clive Kearon"],"title":"Comparison of clinical probability-adjusted D-dimer and age-adjusted D-dimer interpretation to exclude venous thromboembolism","link":"","description":"Two new strategies for interpreting D-dimer results have been proposed: i) using a progressively higher D-dimer threshold with increasing age (age-adjusted strategy) and ii) using a D-dimer threshold in patients with low clinical probability that is twice the threshold used in patients with moderate clinical probability (clinical probability-adjusted strategy). Our objective was to compare the diagnostic accuracy of age-adjusted and clinical probability-adjusted D-dimer interpretation in patients with a low or moderate clinical probability of venous thromboembolism (VTE). We performed a retrospective analysis of clinical data and blood samples from two prospective studies. We compared the negative predictive value (NPV) for VTE, and the proportion of patients with a negative D-dimer result, using two D-dimer interpretation strategies: the age-adjusted strategy, which uses a progressively higher D-dimer threshold with\xa0\u2026","yearPublished":"2017","citedBy":15,"category":{"type":"JOURNAL","categoryTitle":"Thrombosis and haemostasis","pages":"1937-1943","publisher":"Schattauer GmbH","volume":"117","issue":"10"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2017},{"_id":"61077d1ebee37141f4f136c4","authors":["S Vedantham","SZ Goldhaber","JA Julian","SR Kahn","MR Jaff","A Jull","A Wadham","C Bullen","V Parag","N Kerse","J Waters","S Gadan","H Floodeen","R Lindgren","P Matthiessen","A Visscher","T Lam","MM Meurs-Szojda","R Felt-Bersma"],"title":"Long GV, Hauschild A, Santinami M, Atkinson V, Mandal\xe0 M, Chiarion-Sileni V et al. Adjuvant dabrafenib plus trametinib in stage III BRAF-mutated melanoma. N Engl J Med 2017\xa0\u2026","link":"","description":"In this trial that included 906 patients, the active agents were given intravenously for up to 1 year. Twelve-month recurrence-free survival was 70\u22c5 5 per cent with nivolumab and 60\u22c5 8 per cent with ipilimumab, P< 0\u22c5 001. Side-effects were more common with ipilimumab (45\u22c5 9 versus 14\u22c5 4 per cent).","yearPublished":"2017","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"BMJ","pages":"j5157","publisher":"","volume":"359","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.001Z","updatedAt":"2021-08-02T05:05:35.001Z","year":2017},{"_id":"61077d1ebee37141f4f136c1","authors":["Ian S Dayes","Sameer Parpia","Jaclyn Gilbert","Jim A Julian","Ian R Davis","Mark N Levine","Jinka Sathya"],"title":"Long-term results of a randomized trial comparing iridium implant plus external beam radiation therapy with external beam radiation therapy alone in node-negative locally\xa0\u2026","link":"https://www.urotoday.com/recent-abstracts/urologic-oncology/prostate-cancer/99580-long-term-results-of-a-randomized-trial-comparing-iridium-implant-plus-external-beam-radiation-therapy-with-external-beam-radiation-therapy-beyond-the-abstract.html","description":"Purpose\\nTo determine the impact on long-term survival from the addition of brachytherapy to external beam radiation therapy (EBRT) in patients with prostate cancer.\\nMethods and Materials\\nBetween 1992 and 1997, 104 men with cT2-3, surgically staged node-negative prostate cancer were randomized to receive either EBRT\xa0(40\xa0Gy/20 fractions) with iridium implant (35\xa0Gy/48\xa0hours) or EBRT alone (66\xa0Gy/33 fractions) to the prostate. According to T stage, Gleason score, and prostate-specific antigen level, 60% of patients had high-risk disease. Substantial improvements in biochemical control at 8\xa0years have previously been reported. Additional follow-up was collected on deaths and metastases.\\nResults\\nMedian follow-up was 14\xa0years. Five patients were lost to follow-up. All other patients have been followed a minimum of 13\xa0years. There have been 75 deaths, including 21 from prostate cancer and 25 from second\xa0\u2026","yearPublished":"2017","citedBy":57,"category":{"type":"JOURNAL","categoryTitle":"International Journal of Radiation Oncology* Biology* Physics","pages":"90-93","publisher":"Elsevier","volume":"99","issue":"1"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-02T05:05:35.000Z","updatedAt":"2021-08-02T05:05:35.000Z","year":2017},{"_id":"610f93e58e338e5b6446da6c","authors":["Jie Yen Fan","Kais Hamza","Peter Jagers","Fima C Klebaner"],"title":"SPDE Limits for the age structure of a population","link":"https://www.researchgate.net/profile/Peter-Jagers/publication/314115571_SPDE_Limits_for_the_age_structure_of_a_population/links/58c8c35c92851c2b9d51396a/SPDE-Limits-for-the-age-structure-of-a-population.pdf","description":"We consider a family of general branching processes with reproduction parameters depending on the age of the individual as well as the population age structure and a parameter K, which may represent the carrying capacity. These processes are Markovian in the age structure. In a previous paper [7] the law of large numbers as K\u2192\u221e was derived. Here we prove the Central Limit Theorem, namely the weak convergence of the properly scaled processes in an appropriate Skorokhod space. We also show that the limit is driven by an SPDE.","yearPublished":"2017","citedBy":1,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1702.08592","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2017},{"_id":"610f95618e338e5b6446da9a","authors":["Rongju Zhang","Nicolas Langren\xe9","Yu Tian","Zili Zhu","Fima Klebaner","Kais Hamza"],"title":"Sharp Target Range Strategy for Multiperiod Portfolio Choice by Decensored Least Squares Monte Carlo","link":"https://www.researchgate.net/profile/Rongju-Zhang/publication/315766358_Skewed_target_range_strategy_for_multiperiod_portfolio_optimization_using_a_two-stage_least_squares_Monte_Carlo_method/links/59f80df7a6fdcc075ec7ceaa/Skewed-target-range-strategy-for-multiperiod-portfolio-optimization-using-a-two-stage-least-squares-Monte-Carlo-method.pdf","description":"A novel investment strategy is presented for portfolio choice problems. Our proposed strategy maximizes the expected portfolio value within a target range, composed of a conservative lower target representing capital guarantee and a desired upper target representing investment goal. This strategy favorably shapes the entire probability distribution of return, as it simultaneously seeks a desired expected return, cuts off downside risk, and implicitly caps volatility, skewness and other higher moments. To illustrate the effectiveness of our investment strategy, we study a multi-period portfolio selection problem with transaction cost, and develop a decensored regression approach that improves the classical least squares Monte Carlo algorithm when dealing with truncated and discontinuous payoff functions. Our numerical tests show that the resulting distribution of portfolio wealth mimics the shape of the objective function, and that the presented strategy dominates the classical utility approach in terms of the mean-variance efficient frontier and the trade-off between return and downside risk.","yearPublished":"2017","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1704.00416","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.297Z","updatedAt":"2021-08-08T08:27:13.297Z","year":2017},{"_id":"610f93ad8e338e5b6446da5e","authors":["Chunyang Chen","Zhenchang Xing","Ximing Wang"],"title":"Unsupervised Software-Specific Morphological Forms Inference from Informal Discussions","link":"","description":"Informal discussions on social platforms (e.g., Stack Overflow) accumulates a large body of programming knowledge in natural language text. Natural language process (NLP) techniques can be exploited to harvest this knowledge base for software engineering tasks. To make an effective use of NLP techniques, consistent vocabulary is essential. Unfortunately, the same concepts are often intentionally or accidentally mentioned in many different morphological forms in informal discussions, such as abbreviations, synonyms and misspellings. Existing techniques to deal with such morphological forms are either designed for general English or predominantly rely on domain-specific lexical rules. A thesaurus of software-specific terms and commonly-used morphological forms is desirable for normalizing software engineering text, but very difficult to build manually. In this work, we propose an automatic approach to build\xa0\u2026","yearPublished":"2017","citedBy":47,"category":{"type":"CONFERENCE","categoryTitle":"39th International Conference on Software Engineering (ICSE)","pages":"450-461","publisher":"IEEE/ACM","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2017},{"_id":"610f95618e338e5b6446da9d","authors":["Matthias Horn","Kais Hamza","Elizabeth Skuza","Marcel Nold"],"title":"Association of peripheral eosinophilia with chronic neonatal lung disease in preterm babies","link":"","description":"Introduction: Chronic lung disease of prematurity (BPD) is a common complication of premature birth. Although the cause of BPD is multifactorial an inflammatory process is playing a role in the pathogenesis of BPD. Eosinophils might be part of this inflammatory process. We hypothesized that elevated eosinophil levels in a Full Blood Count (FBC) soon after birth are associated with the development of BPD.\\nMethod: Two separate analyses were performed, which each included 50 premature infants. 25 preterm infants with BPD (mean gestational age 25.9 and 26.1 weeks, mean birth weight 875 and 846 g) were compared to 25 control infants without BPD (mean gestational age 26.3 and 26.1 weeks, mean birth weight 935 and 869 g) in each analysis. In the first analysis, we identified a possible threshold in eosinophil levels that may be used as a predictor for the development of BPD. The second analysis would be\xa0\u2026","yearPublished":"2016","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"European Respiratory Society","volume":"48","issue":"suppl 60"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f95618e338e5b6446daa1","authors":["Jiro Akahori","Andrea Collevecchio","Timothy Garoni","Kais Hamza"],"title":"Attraction properties for general urn processes and applications to a class of interacting reinforced particle systems","link":"https://arxiv.org/pdf/1602.05677","description":"We study a system of interacting reinforced random walks defined on polygons. At each stage, each particle chooses an edge to traverse which is incident to its position. We allow the probability of choosing a given edge to depend on the sum of, the number of times that particle traversed that edge, a quantity which depends on the behaviour of the other particles, and possibly external factors. We study localization properties of this system and our main tool is a new result we establish for a very general class of urn models. More specifically, we study attraction properties of urns composed of balls with two distinct colors which evolve as follows. At each stage a ball is extracted. The probability of picking a ball of a certain color evolves in time. This evolution may depend not only on the composition of the urn but also on external factors or internal ones depending on the history of the urn. A particular example of the latter is when the reinforcement is a function of the composition of the urn and the biggest run of consecutive picks with the same color. The model that we introduce and study is very general, and we prove that under mild conditions, one of the colors in the urn is picked only finitely often.","yearPublished":"2016","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1602.05677","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f95618e338e5b6446da9e","authors":["Andrea Collevecchio","Kais Hamza","Meng Shi"],"title":"Bootstrap random walks","link":"https://www.sciencedirect.com/science/article/pii/S0304414915300247","description":"Consider a one dimensional simple random walk X=(X n) n\u2265 0. We form a new simple symmetric random walk Y=(Y n) n\u2265 0 by taking sums of products of the increments of X and study the two-dimensional walk (X, Y)=((X n, Y n)) n\u2265 0. We show that it is recurrent and when suitably normalised converges to a two-dimensional Brownian motion with independent components; this independence occurs despite the functional dependence between the pre-limit processes. The process of recycling increments in this way is repeated and a multi-dimensional analog of this limit theorem together with a transience result are obtained. The construction and results are extended to include the case where the increments take values in a finite set (not necessarily {\u2212 1,+ 1}).","yearPublished":"2016","citedBy":8,"category":{"type":"JOURNAL","categoryTitle":"Stochastic Processes and their Applications","pages":"1744-1760","publisher":"North-Holland","volume":"126","issue":"6"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f95618e338e5b6446da9c","authors":["Rongju Zhang","Nicolas Langren\xe9","Yu Tian","Zili Zhu","Fima Klebaner","Kais Hamza"],"title":"Efficient simulation method for dynamic portfolio selection with transaction cost, Liquidity Cost and Market Impact","link":"https://www.researchgate.net/profile/Fima-Klebaner/publication/309425036_Dynamic_portfolio_optimization_with_liquidity_cost_and_market_impact_a_simulation-and-regression_approach/links/583ae4c608aef00f3bfd5aa4/Dynamic-portfolio-optimization-with-liquidity-cost-and-market-impact-a-simulation-and-regression-approach.pdf","description":"We develop an efficient method for solving dynamic portfolio selection problems in the presence of transaction cost, liquidity cost and market impact. Our method, based on least-squares Monte Carlo simulation, has no restriction on return dynamics, portfolio constraints, intermediate consumption and investor\u2019s objective. We model return dynamics as exogenous state variables and model portfolio weights, price dynamics and portfolio value as endogenous state variables. This separation allows for incorporation of any formation of transaction cost, liquidity cost and market impact. We first perform a forward simulation for both exogenous and endogenous state variables, then use a leastsquares regression to approximate the backward recursive dynamic programs on a discrete grid of controls. Finally, we use a local interpolation and an adaptive refinement grid to enhance the optimal allocation estimates. The computational runtime of this framework grows polynomially with dimension. Its viability is illustrated on a realistic portfolio allocation example with twelve risky assets.","yearPublished":"2016","citedBy":4,"category":{"type":"JOURNAL","categoryTitle":"arXiv preprint arXiv:1610.07694","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f93ad8e338e5b6446da60","authors":["Guibin Chen","Chunyang Chen","Zhenchang Xing","Bowen Xu"],"title":"Learning a dual-language vector space for domain-specific cross-lingual question retrieval","link":"","description":"The lingual barrier limits the ability of millions of non-English speaking developers to make effective use of the tremendous knowledge in Stack Overflow, which is archived in English. For cross-lingual question retrieval, one may use translation-based methods that first translate the non-English queries into English and then perform monolingual question retrieval in English. However, translation-based methods suffer from semantic deviation due to inappropriate translation, especially for domain-specific terms, and lexical gap between queries and questions that share few words in common. To overcome the above issues, we propose a novel cross-lingual question retrieval based on word embed-dings and convolutional neural network (CNN) which are the state-of-the-art deep learning techniques to capture word- and sentence-level semantics. The CNN model is trained with large amounts of examples from Stack\xa0\u2026","yearPublished":"2016","citedBy":46,"category":{"type":"CONFERENCE","categoryTitle":"2016 31st IEEE/ACM International Conference on Automated Software Engineering (ASE)","pages":"744-755","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f93ad8e338e5b6446da63","authors":["Chunyang Chen","Sa Gao","Zhenchang Xing"],"title":"Mining Analogical Libraries in Q&A Discussions -Incorporating Relational and Categorical Knowledge into Word Embedding","link":"","description":"Third-party libraries are an integral part of many software projects. It often happens that developers need to find analogical libraries that can provide comparable features to the libraries they are already familiar with. Existing methods to find analogical libraries are limited by the community-curated list of libraries, blogs, or Q&A posts, which often contain overwhelming or out-of-date information. In this paper, we present a new approach to recommend analogical libraries based on a knowledge base of analogical libraries mined from tags of millions of Stack Overflow questions. The novelty of our approach is to solve analogical-libraries questions by combining state-of-the-art word embedding technique and domain-specific relational and categorical knowledge mined from Stack Overflow. We implement our approach in a proof-of-concept web application (https://graphofknowledge.appspot.com/similartech). The\xa0\u2026","yearPublished":"2016","citedBy":59,"category":{"type":"CONFERENCE","categoryTitle":"The 23rd IEEE International Conference on Software Analysis, Evolution, and Reengineering (SANER)","pages":"338--348","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f93ad8e338e5b6446da5f","authors":["Chunyang Chen","Zhenchang Xing"],"title":"Mining Technology Landscape from Stack Overflow","link":"","description":"The sheer number of available technologies and the complex relationships among them make it challenging to choose the right technologies for software projects. Developers often turn to online resources (eg, expert articles and community answers) to get a good understanding of the technology landscape. Such online resources are primarily opinion-based and are often out of date. Furthermore, information is often scattered in many online resources, which has to be aggregated to have a big picture of the technology landscape. In this paper, we exploit the fact that Stack Overflow users tag their questions with the main technologies that the questions revolve around, and develop association rule mining and community detection techniques to mine technology landscape from Stack Overflow question tags. The mined technology landscape is represented in a graphical Technology Associative Network (TAN). Our\xa0\u2026","yearPublished":"2016","citedBy":48,"category":{"type":"CONFERENCE","categoryTitle":"Proceedings of the 10th ACM/IEEE International Symposium on Empirical Software Engineering and Measurement","pages":"14:1-14:10","publisher":"ACM","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f95618e338e5b6446daa0","authors":["Kais Hamza","Peter Jagers","Fima C Klebaner"],"title":"On the establishment, persistence, and inevitable extinction of populations","link":"https://arxiv.org/pdf/1410.2973","description":"Comprehensive models of stochastic, clonally reproducing populations are defined in terms of general branching processes, allowing birth during maternal life, as for higher organisms, or by splitting, as in cell division. The populations are assumed to start small, by mutation or immigration, reproduce supercritically while smaller than the habitat carrying capacity but subcritically above it. Such populations establish themselves with a probability wellknown from branching process theory. Once established, they grow up to a band around the carrying capacity in a time that is logarithmic in the latter, assumed large. There they prevail during a time period whose duration is exponential in the carrying capacity. Even populations whose life style is sustainble in the sense that the habitat carrying capacity is not eroded but remains the same, ultimately enter an extinction phase, which again lasts for a time logarithmic\xa0\u2026","yearPublished":"2016","citedBy":17,"category":{"type":"JOURNAL","categoryTitle":"Journal of mathematical biology","pages":"797-820","publisher":"Springer Berlin Heidelberg","volume":"72","issue":"4"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f93ad8e338e5b6446da61","authors":["Chunyang Chen","Zhenchang Xing"],"title":"Similartech: automatically recommend analogical libraries across different programming languages","link":"","description":"Third-party libraries are an integral part of many software projects. It often happens that developers need to find analogical libraries that can provide comparable features to the libraries they are already familiar with. Existing methods to find analogical libraries are limited by the community-curated list of libraries, blogs, or Q&A posts, which often contain overwhelming or out-of-date information. This paper presents our tool SimilarTech (https://graphofknowledge. appspot. com/similartech) that makes it possible to automatically recommend analogical libraries by incorporating tag embeddings and domain-specific relational and categorical knowledge mined from Stack Overflow. SimilarTech currently supports recommendation of 6,715 libraries across 6 different programming languages. We release our SimilarTech website for public use. The SimilarTech website attracts more than 2,400 users in the past 6 months. We\xa0\u2026","yearPublished":"2016","citedBy":32,"category":{"type":"BOOK","categoryTitle":"Proceedings of the 31st IEEE/ACM International Conference on Automated Software Engineering","pages":"834-839","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f93ad8e338e5b6446da64","authors":["Chunyang Chen","Zhenchang Xing","Lei Han"],"title":"Techland: Assisting technology landscape inquiries with insights from stack overflow","link":"","description":"Understanding the technology landscape is crucial for the success of the software-engineering project or organization. However, it can be difficult, even for experienced developers, due to the proliferation of similar technologies, the complex and often implicit dependencies among technologies, and the rapid development in which technology landscape evolves. Developers currently rely on online documents such as tutorials and blogs to find out best available technologies, technology correlations, and technology trends. Although helpful, online documents often lack objective, consistent summary of the technology landscape. In this paper, we present the TechLand system for assisting technology landscape inquiries with categorical, relational and trending knowledge of technologies that is aggregated from millions of Stack Overflow questions mentioning the relevant technologies. We implement the TechLand\xa0\u2026","yearPublished":"2016","citedBy":28,"category":{"type":"CONFERENCE","categoryTitle":"IEEE International Conference on Software Maintenance and Evolution","pages":"356-366","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f93ad8e338e5b6446da62","authors":["Chunyang Chen","Zhenchang Xing"],"title":"Towards Correlating Search on Google and Asking on Stack Overflow","link":"https://scholar.archive.org/work/jfgwqwnvk5ea3iat5b4i5hlh2i/access/wayback/http://ccywch.github.io:80/chenchunyang.github.io/publication/ask_search_correlation.pdf","description":"Search engines and Question and Answer (Q&A) sites are the two commonly used ways for developers to seek information on the web. In this paper, we ask whether the questions developers ask on Q&A sites correlate with the information developers search for using search engines. We report on our empirical study to investigate the correlations of the 185 popular technical terms developers search on Google and ask on Stack Overflow using search statistics obtained from Google Trends over a 574-weeks span and question statistics derived from Stack Overflow Data Dump over a 300-weeks span. Our study shows that technical terms searched and asked have strong correlation over time. Search and asking of newer, specific technical terms have stronger correlation, compared with older, general technical terms. We have developed a web interface for accessing our dataset and empirical results available at http\xa0\u2026","yearPublished":"2016","citedBy":26,"category":{"type":"CONFERENCE","categoryTitle":"The 40th IEEE Computer Society International Conference on Computers, Software & Applications","pages":"83-92","publisher":"IEEE","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2016},{"_id":"610f95618e338e5b6446da9f","authors":["L Ruane","K Low","N Uddin","P Finlay","K Lau","K Hamza","G Hamilton","P Bardin"],"title":"VOCAL CORD DYSFUNCTION IN MILD AND SEVERE ASTHMA: AO 010","link":"","description":"","yearPublished":"2016","citedBy":null,"category":{"type":"JOURNAL","categoryTitle":"Respirology","pages":"","publisher":"","volume":"21","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:27:13.298Z","updatedAt":"2021-08-08T08:27:13.298Z","year":2016},{"_id":"610f93e58e338e5b6446da6d","authors":["Jie Yen Fan","Kais Hamza","Fima Klebaner"],"title":"Mimicking self-similar processes","link":"https://projecteuclid.org/journals/bernoulli/volume-21/issue-3/Mimicking-self-similar-processes/10.3150/13-BEJ588.pdf","description":"We construct a family of self-similar Markov martingales with given marginal distributions. This construction uses the self-similarity and Markov property of a reference process to produce a family of Markov processes that possess the same marginal distributions as the original process. The resulting processes are also self-similar with the same exponent as the original process. They can be chosen to be martingales under certain conditions. In this paper, we present two approaches to this construction, the transition-randomising approach and the time-change approach. We then compute the infinitesimal generators and obtain some path properties of the resulting processes. We also give some examples, including continuous Gaussian martingales as a generalization of Brownian motion, martingales of the squared Bessel process, stable L\xe9vy processes as well as an example of an artificial process having the marginals of\xa0\u2026","yearPublished":"2015","citedBy":15,"category":{"type":"JOURNAL","categoryTitle":"Bernoulli","pages":"1341-1360","publisher":"Bernoulli Society for Mathematical Statistics and Probability","volume":"21","issue":"3"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2015},{"_id":"610f93e58e338e5b6446da6e","authors":["Jie Yen Fan"],"title":"Mimicking Self-similar Markov Martingales and Extensions","link":"https://scholar.archive.org/work/vw5kui52ezgbtgiyxwq63lcjiu/access/wayback/https://au-east.erc.monash.edu.au/fpfiles/7642075/monash_131143.pdf","description":"As stochastic processes are not uniquely defined by their marginal distributions, it is of interest to construct different processes that match the marginal distributions of a given process\u2014we call this mimicking process. In this thesis, we provide a construction scheme to mimic any self-similar, Markov, martingale process. Given such a process, we can construct a family of processes that are also self-similar and Markovian, and can be chosen to be martingales under certain condition. This mimicking can be done by randomising the transition function, or by time-changing the process together with an appropriate scaling. We obtain also the infinitesimal generator and some properties of the resulting processes. Some examples are also provided, together with the computations of the infinitesimal generators and the predictable quadratic variations of the resulting processes. We then extend our construction to mimic a broader class of processes, including some non-Markov processes. iii","yearPublished":"2014","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2014},{"_id":"610f93e58e338e5b6446da6f","authors":["JY Fan","K Hamza","FC Klebaner"],"title":"On the Markov property of some Brownian martingales","link":"https://www.sciencedirect.com/science/article/pii/S0304414912001238","description":"Let h n be the (probabilists\u2019) Hermite polynomial of degree n. Let H n (z, a)= a n/2 h n (z/a) and H n (z, 0)= z n. It is well-known that H n (B t, t) is a martingale for every n. In this paper, we show that for n\u2265 3, H n (B t, t) is not Markovian. We then give a brief discussion on mimicking H n (B t, t) in the sense of constructing martingales whose marginal distributions match those of H n (B t, t).","yearPublished":"2012","citedBy":2,"category":{"type":"JOURNAL","categoryTitle":"Stochastic Processes and their Applications","pages":"3506-3512","publisher":"North-Holland","volume":"122","issue":"10"},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2012},{"_id":"610f93e58e338e5b6446da70","authors":["Jie Yen Fan","Kais Hamza","Peter Jagers","Fima Klebaner"],"title":"Limit theorems for multi-type general branching processes with population size and structure dependence","link":"https://www.researchgate.net/profile/Peter-Jagers/publication/331700617_Limit_theorems_for_multi-type_general_branching_processes_with_population_dependence/links/5e946e43a6fdcca78912a96a/Limit-theorems-for-multi-type-general-branching-processes-with-population-dependence.pdf","description":"Keywords Age and type structure dependent population processes\xb7 size dependent reproduction\xb7 carrying capacity\xb7 law of large numbers\xb7 central limit theorem\xb7 diffusion approximation","yearPublished":"2000","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:20:53.894Z","updatedAt":"2021-08-08T08:20:53.894Z","year":2000},{"_id":"610f93ad8e338e5b6446da65","authors":["Kelly Blincoe","Zhenchang Xing","Giuliano Antoniol","Francesca Arcelli Fontana","Venera Arnaoudova","Hamid Bagheri","Maria Teresa Baldassarre","Lingfeng Bao","Gabriele Bavota","Olga Baysal","\xc1rp\xe1d Besz\xe9des","Dave Binkley","Fernando Castor","Gemma Catolino","Chunyang Chen","Tse-Hsun Peter Chen","James Clause","Anthony Cleve","Eleni Constantinou","Diego Elias Damasceno Costa","Andrea De Lucia"],"title":"Research Track","link":"https://ieeexplore.ieee.org/iel7/9240597/9240598/09240652.pdf","description":"Page 1. Program Committee Research Track Kelly Blincoe, University of Auckland, New Zealand (Co-Chair) Zhenchang Xing, Australian National University, Australia (Co-Chair) Giuliano Antoniol, Ecole Polytechnique de Montr\xe9al, Canada Francesca Arcelli Fontana, University of Milano - Bicocca, Italy Venera Arnaoudova, Washington State University, USA Hamid Bagheri, University of California, Irvine, USA Maria Teresa Baldassarre, University of Bari, Italy Lingfeng Bao, Zhejiang University, China Gabriele Bavota, Universit\xe0 della Svizzera italiana (USI), Switzerland Olga Baysal, Carleton University, Canada \xc1rp\xe1d Besz\xe9des, University of Szeged, Hungary Dave Binkley, Loyola University Maryland, USA Tegawend\xe9 F. Bissyand\xe9, SnT, University of Luxembourg, Luxembourg Fernando Castor, Universidade Federal de Pernambuco, Brazil Gemma Catolino, Delft University of Technology, The Netherlands\xa0\u2026","yearPublished":"2000","citedBy":null,"category":{"type":"OTHER","categoryTitle":"","pages":"","publisher":"","volume":"","issue":""},"teamId":"6105283db9496004d4f0b74b","__v":0,"createdAt":"2021-08-08T08:19:57.605Z","updatedAt":"2021-08-08T08:19:57.605Z","year":2000}]'),b=JSON.parse('{"_id":"6105283db9496004d4f0b74b","email":"test@001","teamName":"Team001","orgName":"SomeOrg","twitterHandle":"MonashUni"}'),v=JS